                        new { Id = 170, Author = "Sissel Paaske", Content = "Produksjon ved hjelp av trykkavlasting vil si at trykket i reservoaret er drivkraften til produksjonen. Etterhvert som reservoaret tømmes, vil trykket falle og trykket ved brønnhodet synker. I senfasen vil produksjonen kreve trykkstøtte fra f.eks. injeksjon i feltet eller med pumper i brønnen.", Created = "2018-06-22T15:42:11Z", ExternalId = 150238, StatusId = 1, Title = "Trykkavlasting ", Updated = "2018-09-04T08:43:56Z" },
                        new { Id = 171, Author = "Sissel Paaske", Content = "Produksjon ved hjelp av trykkavlasting vil si at trykket i reservoaret er drivkraften til produksjonen. Ettehvert som reservoaret tømmes, vil trykket falle og trykket ved brønnhodet synker. I senfasen vi produksjonen kreve trykkstøtte fra f.eks. injeksjon i feltet eller med pumper i brønnen.", Created = "2018-06-22T15:42:11Z", ExternalId = 150238, StatusId = 1, Title = "Trykkavlasting ", Updated = "2018-09-04T08:43:56Z" },
                        new { Id = 445, Author = "Yttervik Reinholdtsen Lisbeth", Content = "En emulsjonsbryter er et stoff som kan hjelpe emulgerte stoffer å separeres fra hverandre. En emulsjon er en miks av to eller flere væsker som ikke kan blandes på vanlig måte. En normal blanding er for eksempel vann og saft, som begge er vannbaserte og blandes fullstendig sammen. Olje og vann derimot vil bestå av dråpefase i væskefase, enten som vanndråper i olje eller som oljedråper i vann.", Created = "2018-06-22T15:35:58Z", ExternalId = 149947, StatusId = 1, Title = "Emulsjonsbryter", Updated = "2018-09-04T08:43:44Z" },
