                        new { Id = 172, Author = "Sissel Paaske", Content = "Nærbrønnområdet er den delen av formasjonen/bergarten som grenser til brønnen som bores.", Created = "2018-06-22T15:35:22Z", ExternalId = 153313, StatusId = 1, Title = "Nærbrønnområdet ", Updated = "2018-09-04T08:43:40Z" },
