                        new { Id = 511, Author = "Sissel Paaske", Content = "Gass- og vann-gjennombrudd beskriver situasjonen som oppstår når oljeproduksjonen går over til en ny fase med vann eller gass som følger oljen opp til overflaten. Vanngjennombrudd er et problem fordi vannet er forurenset og må behandles før det kan dumpes. Gassgjennombrudd er et problem fordi trykket i reservoaret faller dramatisk når gassen strømmer fritt ut i brønnen, noe som gjør at oljereserven blir liggende igjen i oljefellen.", Created = "2018-06-22T15:38:46Z", ExternalId = 154126, StatusId = 1, Title = "Gjennombrudd", Updated = "2018-09-04T08:43:36Z" },
                        new { Id = 512, Author = "Sissel Paaske", Content = "Gass- og vann-gjennombrudd beskriver situasjonen som oppstår når oljeproduksjonen går over til en ny fase med vann eller gass som følger oljen opp til overflaten. Vanngjennombrudd er et problem fordi vannet er forurenset og må behandles før det kan dumpes. Gassgjennombrudd er et problem fordi trykket i reservoaret faller dramatisk når gassen strømmer fritt ut i brønnen, noe som gjør at oljereserven blir liggende igjen i oljefellen.", Created = "2018-06-22T15:38:46Z", ExternalId = 154126, StatusId = 1, Title = "Gjennombrudd", Updated = "2018-09-04T08:43:36Z" },
                        new { Id = 259, Author = "Sissel Paaske", Content = "Kokepunktstrykk (bubble point pressure) er trykket ved en gitt temperatur som gjør at væsken (oljen) slipper ut gass fra væskeformen. Gass kan frigjøres ved at trykk/temperatur økes (vann til vanndamp) eller reduseres (uttak av olje fra reservoar). Et eksempel på norsk sokkel: ... kokepunktet for oljen målt til 6 bar under reservoartrykket ved reservoartemperatur. Reservoartrykket var 408 bar.", Created = "2018-06-22T15:38:40Z", ExternalId = 153769, StatusId = 1, Title = "Kokepunktstrykk", Updated = "2018-09-04T08:43:32Z" },
                        new { Id = 260, Author = "Sissel Paaske", Content = "Kokepunktstrykk (bubble point pressure) er trykket ved en gitt temperatur som gjør at væsken (oljen) slipper ut gass fra væskeformen. Gass kan frigjøres ved at trykk/temperatur økes (vann til vanndamp) eller reduseres (uttak av olje fra reservoar). Et eksempel på norsk sokkel: ... kokepunktet for oljen målt til 6 bar under reservoartrykket ved reservoartemperatur. Reservoartrykket var 408 bar.", Created = "2018-06-22T15:38:40Z", ExternalId = 153769, StatusId = 1, Title = "Kokepunktstrykk", Updated = "2018-09-04T08:43:32Z" },
                        new { Id = 331, Author = "Sissel Paaske", Content = "API - American Petroleum Institute. API er mest kjent for arbeidet med utforming og regulering av standarder til den amerikanske olje- og gassindustrien, på samme måte som NORSOK fungerer for norsk sokkel. API standard er internasjonalt akseptert og refereres til blant annet i norske standarder. API tilbyr også godkjenning (sertifisering) og opplæring.", Created = "2018-06-22T15:33:49Z", ExternalId = 160648, StatusId = 1, Title = "API", Updated = "2018-09-04T08:43:51Z" },
