                        new { Id = 144, Author = "Liv Dagrunn Andreassen", Content = "Nødavstenging av brønner deles i to nivå: NAS 2 stenger brønnene ved DHSV. NAS 1 stenger hovedgenerator og starter nødstrøm. I tillegg isoleres alt som kan bidra til eksplosjon. Nødavstenging initieres automatisk ved feil i kritiske komponenter og kan også utløses ved manuell trykknapp.", Created = "2018-06-22T15:41:42Z", ExternalId = 181907, StatusId = 1, Title = "NAS (nødavstengning)", Updated = "2018-09-04T08:43:39Z" },
