                        new { Id = 499, Author = "Sissel Paaske", Content = "Permeabiliteten til et porøst materiale (f.eks. reservoarbergart) er et mål for gjennomstrømmeligheten i materialet. Det vil si evnen til å transportere væske eller gass fra et område til et annet område i materialet. Det er kanaler som forbinder porene i materialet. Permeabilitet måles i darcy.", Created = "2018-06-22T15:35:22Z", ExternalId = 153312, StatusId = 1, Title = "Permeabilitet ", Updated = "2018-09-04T08:44:13Z" },
