                        new { Id = 100, Author = "", Content = "Nesten alle saker som tas opp på Stortinget, behandles først i en fagkomité. Fagkomiteene har ulike arbeidsområder. Alle stortingsrepresentantene sitter i en fagkomité.", Created = "2018-06-22T15:02:29Z", ExternalId = 11270, StatusId = 1, Title = "Fagkomité", Updated = "2018-08-20T10:16:46Z" },
                        new { Id = 101, Author = "", Content = "Nesten alle saker som skal takast opp på Stortinget, blir først handsama i ein fagkomité. Fagkomiteane har ulike arbeidsområde. Alle stortingsrepresentantane sit i ein fagkomité.", Created = "2018-06-22T15:02:29Z", ExternalId = 11270, StatusId = 1, Title = "Fagkomité", Updated = "2018-08-20T10:16:46Z" },
                        new { Id = 216, Author = "", Content = "Spørretime er et møte på Stortinget der stortingsrepresentantene kan stille spørsmål til statsrådene. Spørretimen holdes normalt hver onsdag. I den muntlige spørretimen svarer statsrådene spontant på spørsmål de ikke har fått høre på forhånd. Vanligvis møter to til tre statsråder til den muntlige spørretimen. I den ordinære spørretimen besvares spørsmål som er blitt innlevert av representantene senest fredagen uken før, og som statsrådene dermed har forberedt seg på.", Created = "2018-06-22T15:02:27Z", ExternalId = 11284, StatusId = 1, Title = "Spørretime", Updated = "2018-08-20T10:16:45Z" },
                        new { Id = 217, Author = "", Content = "Spørjetime er eit møte på Stortinget der stortingsrepresentantane kan stille spørsmål til statsrådane. Spørjetimen blir normalt halden kvar onsdag. I den munnlege spørjetimen svarer statsrådane spontant på spørsmål dei ikkje har fått høyre på førehand. Til vanleg møter to til tre statsrådar til den munnlege spørjetimen. I den ordinære spørjetimen svarer statsrådane på spørsmål som er blitt leverte inn av representantane seinast fredagen veka før, og som statsrådane dermed har førebudd seg på.", Created = "2018-06-22T15:02:27Z", ExternalId = 11284, StatusId = 1, Title = "Spørjetime", Updated = "2018-08-20T10:16:45Z" },
                        new { Id = 483, Author = "Inga Berntsen Rudi", Content = "En stortingssesjon er den tida stortinget sitter sammen, eller er samlet. Stortingssesjonen starter som regel i oktober og avsluttes i slutten av juni. Stortinget er altså ikke samlet på sommeren.", Created = "2018-06-22T15:02:28Z", ExternalId = 51216, StatusId = 1, Title = "Stortingssesjon", Updated = "2018-08-20T10:16:45Z" },
                        new { Id = 484, Author = "Inga Berntsen Rudi", Content = "Ein stortingssesjon er den tida stortinget sit saman, eller er samla. Stortingssesjonen startar som regel i oktober og blir avslutta i slutten av juni. Stortinget er altså ikkje samla på sommaren.", Created = "2018-06-22T15:02:28Z", ExternalId = 51216, StatusId = 1, Title = "Stortingssesjon", Updated = "2018-08-20T10:16:45Z" },
                        new { Id = 517, Author = "", Content = "En forskrift er en detaljbestemmelse til en lov vedtatt av Stortinget. Når Stortinget vedtar loven, overlates det ofte til regjeringen å utarbeide de utfyllende detaljene. Slike detaljbestemmelser kan endres uten at loven må opp til ny behandling i Stortinget.", Created = "2018-06-22T15:02:31Z", ExternalId = 11273, StatusId = 1, Title = "Forskrift", Updated = "2018-08-20T10:16:47Z" },
                        new { Id = 518, Author = "", Content = "Ei forskrift er ei detaljert presisering til ei lov vedteken av Stortinget. Når Stortinget vedtek lova, blir det ofte overlate til regjeringa å utarbeide dei utfyllande detaljane. Forskriftene kan endrast utan at lova må opp til ny handsaming i Stortinget.", Created = "2018-06-22T15:02:31Z", ExternalId = 11273, StatusId = 1, Title = "Forskrift", Updated = "2018-08-20T10:16:47Z" },
                        new { Id = 513, Author = "", Content = "Statsbudsjettet er et budsjett over statens inntekter og utgifter. Det vedtas i Stortinget i slutten av hver høstsesjon. Forslaget til statsbudsjett fremmes av regjeringen og får alltid \"Proposisjon til Stortinget nr. 1\" (Prop. 1 S.) i navnet sitt.", Created = "2018-06-22T15:02:27Z", ExternalId = 11286, StatusId = 1, Title = "Statsbudsjett", Updated = "2018-08-20T10:16:44Z" },
                        new { Id = 514, Author = "", Content = "Statsbudsjettet er eit budsjett over inntektene og utgiftene til staten. Det blir vedteke i Stortinget i slutten av kvar haustsesjon. Forslaget til statsbudsjett blir fremja av regjeringa og får alltid \"Proposisjon til Stortinget nr. 1\" (Prop. 1 S.) i namnet sitt.", Created = "2018-06-22T15:02:27Z", ExternalId = 11286, StatusId = 1, Title = "Statsbudsjett", Updated = "2018-08-20T10:16:44Z" },
                        new { Id = 141, Author = "", Content = "Fullmaktslov er en lov der Stortinget overlater (delegerer) til regjeringen og forvaltningen å utforme nærmere detaljerte regler og forskrifter innenfor lovens område.", Created = "2018-06-22T15:02:31Z", ExternalId = 11267, StatusId = 1, Title = "Fullmaktslov", Updated = "2018-08-20T10:16:48Z" },
                        new { Id = 142, Author = "", Content = "Fullmaktslov er ei lov som Stortinget overlèt (delegerer) til regjeringa og forvaltinga å utforme nærmare detaljerte reglar og forskrifter til innanfor området for lova.", Created = "2018-06-22T15:02:31Z", ExternalId = 11267, StatusId = 1, Title = "Fullmaktslov", Updated = "2018-08-20T10:16:48Z" },
                        new { Id = 345, Author = "", Content = "Ei partigruppe er en gruppe bestående av alle representantene fra samme politiske parti på Stortinget. Alle stortingsrepresentantene tilhører en partigruppe i Stortinget.", Created = "2018-06-22T15:02:30Z", ExternalId = 11280, StatusId = 1, Title = "Partigruppe", Updated = "2018-08-20T10:16:47Z" },
                        new { Id = 346, Author = "", Content = "Ei partigruppe er ei gruppe sett saman av alle representantane frå same politiske parti på Stortinget. Alle stortingsrepresentantane høyrer til i ei partigruppe i Stortinget.", Created = "2018-06-22T15:02:30Z", ExternalId = 11280, StatusId = 1, Title = "Partigruppe", Updated = "2018-08-20T10:16:47Z" },
                        new { Id = 35, Author = "", Content = "En rettsstat er en stat hvor domstolene er uavhengige av de politiske myndighetene, og hvor ingen skal kunne settes i fengsel eller straffes uten å ha fått prøvd saken sin for en domstol.", Created = "2018-05-04T15:54:03Z", ExternalId = 11213, StatusId = 1, Title = "rettsstat", Updated = "2018-08-17T16:48:58Z" },
                        new { Id = 36, Author = "", Content = "Ein rettsstat er ein stat der domstolane er uavhengige av dei politiske styresmaktene, og der ingen skal kunne setjast i fengsel eller straffast utan å ha fått prøvd saka si for ein domstol.", Created = "2018-05-04T15:54:03Z", ExternalId = 11213, StatusId = 1, Title = "rettsstat", Updated = "2018-08-17T16:48:58Z" },
                        new { Id = 433, Author = "", Content = "Sosialliberalisme er en politisk ideologi (tankesett) som vil gjennomføre sosiale reformer innenfor rammen av det privatkapitalistiske systemet. I teorien er individet et selvstendig vesen og samtidig sosialt avhengig. Staten bør derfor til en viss grad regulere samfunnsforholdene, men bare slik at det blir sosialt forsvarlig med individuell utfoldelse.", Created = "2018-05-04T15:54:04Z", ExternalId = 11347, StatusId = 1, Title = "sosialliberalisme", Updated = "2018-08-17T16:49:01Z" },
                        new { Id = 434, Author = "", Content = "Sosialliberalisme er ein politisk ideologi (tankesett) som vil gjennomføre sosiale reformer innanfor ramma av det privatkapitalistiske systemet. I teorien er individet eit sjølvstendig vesen og samstundes sosialt avhengig. Staten bør derfor til ein viss grad regulere samfunnstilhøva, men berre slik at det blir sosialt forsvarleg med individuell utfalding.", Created = "2018-05-04T15:54:04Z", ExternalId = 11347, StatusId = 1, Title = "sosialliberalisme", Updated = "2018-08-17T16:49:01Z" },
                        new { Id = 25, Author = "", Content = "Pragmatisme er en holdning som innebærer at en retter seg etter de forhold som er.", Created = "2018-05-04T15:54:05Z", ExternalId = 11333, StatusId = 1, Title = "pragmatisme", Updated = "2018-08-17T16:49:02Z" },
                        new { Id = 26, Author = "", Content = "Pragmatisme er ei haldning som inneber at ein rettar seg etter dei tilhøva som er.", Created = "2018-05-04T15:54:05Z", ExternalId = 11333, StatusId = 1, Title = "pragmatisme", Updated = "2018-08-17T16:49:02Z" },
                        new { Id = 21, Author = "", Content = "Liberalisme er en politisk ideologi (tankesett) som krever politisk, religiøs og økonomisk frihet for den enkelte uten statlig innblanding.", Created = "2018-05-04T15:54:06Z", ExternalId = 11345, StatusId = 1, Title = "liberalisme", Updated = "2018-08-17T16:49:06Z" },
                        new { Id = 22, Author = "", Content = "Liberalisme er ein politisk ideologi (tankesett) som krev politisk, religiøs og økonomisk fridom for den einskilde utan statleg innblanding.", Created = "2018-05-04T15:54:06Z", ExternalId = 11345, StatusId = 1, Title = "liberalisme", Updated = "2018-08-17T16:49:06Z" },
                        new { Id = 192, Author = "", Content = "Sosialisme er en politisk ideologi (tankesett) som avviser privat eiendomsrett og hevder at produksjonsmidlene skal eies av samfunnet. Den tar avstand fra en kapitalistisk maktkonsentrasjon hos et fåtall, og har i stedet som mål en statlig planøkonomi som tilgodeser alle samfunnsmedlemmenes behov.", Created = "2018-05-04T15:54:07Z", ExternalId = 11346, StatusId = 1, Title = "sosialisme", Updated = "2018-08-17T16:49:09Z" },
                        new { Id = 193, Author = "", Content = "Sosialisme er ein politisk ideologi (tankesett) som avviser privat eigedomsrett og meiner at samfunnet skal eige produksjonsmidla. Han tek avstand frå kapitalistisk maktkonsentrasjon hos eit fåtal. Målet er i staden ein statleg planøkonomi som gagnar behova til alle samfunnsmedlemene.", Created = "2018-05-04T15:54:07Z", ExternalId = 11346, StatusId = 1, Title = "sosialisme", Updated = "2018-08-17T16:49:09Z" },
                        new { Id = 86, Author = "Gro-Anita Mortensen", Content = "Ideologi er et tankesystem som gir uttrykk for et bestemt helhetlig syn på samfunnet. Ideologiene søker å gi svar på spørsmål om hvorfor samfunnet er blitt som det er, hvordan det bør være, hvilke generelle mål politikken bør ha, osv.", Created = "2018-05-04T15:54:07Z", ExternalId = 6699, StatusId = 1, Title = "ideologi", Updated = "2018-08-17T16:49:10Z" },
                        new { Id = 87, Author = "Gro-Anita Mortensen", Content = "Ideologi er eit tankesystem som gir uttrykk for eit bestemt heilskapleg syn på samfunnet. Ideologiane søkjer å gi svar på spørsmål om kvifor samfunnet er blitt som det er, korleis det bør vere, kva for generelle mål politikken bør ha, osb.", Created = "2018-05-04T15:54:07Z", ExternalId = 6699, StatusId = 1, Title = "ideologi", Updated = "2018-08-17T16:49:10Z" },
                        new { Id = 343, Author = "", Content = "Utjevningsmandat er plasser i Stortinget som tildeles de partiene som i oppgjøret etter valget får få mandater i forhold til stemmetall. Det er 19 utjevningsmandater, ett for hvert fylke.", Created = "2018-06-22T15:04:28Z", ExternalId = 11220, StatusId = 1, Title = "Utjevningsmandat", Updated = "2018-08-20T10:18:56Z" },
                        new { Id = 344, Author = "", Content = "Utjevningsmandat er plasser i Stortinget som tildeles de partiene som i oppgjøret etter valget får få mandater i forhold til stemmetall. Det er 19 utjevningsmandater, ett for hvert fylke.", Created = "2018-06-22T15:04:28Z", ExternalId = 11220, StatusId = 1, Title = "Utjevningsmandat", Updated = "2018-08-20T10:18:56Z" },
                        new { Id = 384, Author = "Inga Berntsen Rudi", Content = "Når en person, en organisasjon eller et utvalg får et mandat, betyr det at de får et bestemt oppdrag og fullmakt til å utføre det. De kan for eksempel få i oppdrag å utrede noe (finne ut av noe) eller styre et område. Et mandat kan også være et verv.", Created = "2018-06-22T15:04:28Z", ExternalId = 50417, StatusId = 1, Title = "mandat", Updated = "2018-08-20T10:18:57Z" },
                        new { Id = 385, Author = "Inga Berntsen Rudi", Content = "Når ein person, ein organisasjon eller eit utval får eit mandat, vil det seie at dei får eit særskilt oppdrag og fullmakt til å utføre det. Dei kan til dømes få i oppdrag å greie ut om noko (finne ut av noko) eller styre eit område. Eit mandat kan også vere eit verv.", Created = "2018-06-22T15:04:28Z", ExternalId = 50417, StatusId = 1, Title = "mandat", Updated = "2018-08-20T10:18:57Z" },
                        new { Id = 396, Author = "Inga Berntsen Rudi", Content = "Det å konsultere betyr å søke råd hos en fagkyndig – en som er ekspert på et spesielt fagområde. Når det foregår konsultasjoner mellom to parter, for eksempel Sametinget og norske myndigheter, henvender de seg til hverandre for å spørre om råd og hjelp.", Created = "2018-06-22T15:14:45Z", ExternalId = 50416, StatusId = 1, Title = "konsultasjon", Updated = "2018-08-20T09:58:35Z" },
                        new { Id = 397, Author = "Inga Berntsen Rudi", Content = "Det å konsultere vil seie å søkje råd hos ein fagkyndig – ein som er ekspert på eit særskilt fagområde. Når konsultasjonar går føre seg mellom to partar, til dømes Sametinget og norske styresmakter, vender dei seg til kvarandre for å spørje om råd og hjelp.", Created = "2018-06-22T15:14:45Z", ExternalId = 50416, StatusId = 1, Title = "konsultasjon", Updated = "2018-08-20T09:58:35Z" },
                        new { Id = 281, Author = "Inga Berntsen Rudi", Content = "Det er vanlig at forslag fra forskjellige organisasjoner og instanser, blant annet regjeringen, blir sendt ut på høring. Det betyr at man vil ha skriftlige reaksjoner på forslaget. De som forslagene blir sendt ut på høring til, kalles høringsinstanser. Hvis for eksempel regjeringen fremmer et forslag som gjelder idrett, vil sannsynligvis Idrettsforbundet være en av høringsinstansene. Handler forslaget om noe som vil berøre de samiske områdene, er Sametinget en høringsinstans.", Created = "2018-06-22T15:14:45Z", ExternalId = 50415, StatusId = 1, Title = "høringsinstans", Updated = "2018-08-20T09:58:36Z" },
                        new { Id = 282, Author = "Inga Berntsen Rudi", Content = "Det er vanleg at forslag frå ulike organisasjonar og instansar, mellom andre regjeringa, blir sende ut på høyring. Det tyder at ein vil ha skriftlege reaksjonar på forslaget. Dei som forslaga blir sende ut på høyring til, blir kalla høyringsinstansar. Om til dømes regjeringa fremjar eit forslag som gjeld idrett, vil sannsynlegvis Idrettsforbundet vere ein av høyringsinstansane. Handlar forslaget om noko som vil få verknad for dei samiske områda, er Sametinget ein høyringsinstans.", Created = "2018-06-22T15:14:45Z", ExternalId = 50415, StatusId = 1, Title = "høyringsinstans", Updated = "2018-08-20T09:58:36Z" },
                        new { Id = 323, Author = "Inga Berntsen Rudi", Content = "Et valgmanntall er en oversikt over de personene som har rett til å stemme ved et bestemt valg. For eksempel har kommune- og fylkestingsvalg, stortingsvalg og sametingsvalg hver sine valgmanntall.", Created = "2018-06-22T15:14:46Z", ExternalId = 50418, StatusId = 1, Title = "valgmanntall", Updated = "2018-08-20T09:58:36Z" },
                        new { Id = 324, Author = "Inga Berntsen Rudi", Content = "Eit valmanntal er eit oversyn over dei personane som har rett til å røyste ved eit særskilt val. Til dømes har kommune- og fylkestingsval, stortingsval og sametingsval kvar sine valmanntal.", Created = "2018-06-22T15:14:46Z", ExternalId = 50418, StatusId = 1, Title = "valmanntal", Updated = "2018-08-20T09:58:36Z" },
                        new { Id = 146, Author = "Inga Berntsen Rudi", Content = "Å ratifisere er når et land godkjenner en avtale, for eksempel en konvensjon. Når en avtale er ratifisert, er den bindende. De landene som har ratifisert en avtale, har altså forpliktet seg til å følge den.", Created = "2018-06-22T15:14:47Z", ExternalId = 50204, StatusId = 1, Title = "ratifiserte", Updated = "2018-08-20T09:58:38Z" },
                        new { Id = 147, Author = "Inga Berntsen Rudi", Content = "Å ratifisere er når eit land godkjenner ein avtale, til dømes ein konvensjon. Når ein avtale er ratifisert, er han bindande. Dei landa som har ratifisert ein avtale, har altså forplikta seg til å følgje han.", Created = "2018-06-22T15:14:47Z", ExternalId = 50204, StatusId = 1, Title = "ratifiserte", Updated = "2018-08-20T09:58:38Z" },
                        new { Id = 114, Author = "Inga Berntsen Rudi", Content = "Sedvane (eller seder/skikker) er måter vi opptrer på som er svært vanlige, men som ikke er bestemt i skriftlige regler. Det er altså uskrevne regler som er oppstått i samfunnet over tid, og som folk har rettet seg etter og for eksempel ser på som vanlig skikk og bruk. Sedvanerett er når en sedvane er så innarbeidet at den for eksempel kan brukes i en dom i en rettssak selv om den ikke er skrevet ned i noen lovtekst.", Created = "2018-06-22T15:14:48Z", ExternalId = 50414, StatusId = 1, Title = "sedvanerett", Updated = "2018-08-20T09:58:39Z" },
                        new { Id = 115, Author = "Inga Berntsen Rudi", Content = "Sedvane (eller seder/skikkar) er måtar vi opptrer på som er svært vanlege, men som ikkje er fastsette i skriftlege reglar. Det er altså uskrivne reglar som er oppstått i samfunnet over tid, og som folk har retta seg etter og til dømes ser på som vanleg skikk og bruk. Sedvanerett er når ein sedvane er så innarbeidd at han til dømes kan brukast i ein dom i ei rettssak sjølv om han ikkje er skriven ned i nokon lovtekst.", Created = "2018-06-22T15:14:48Z", ExternalId = 50414, StatusId = 1, Title = "sedvanerett", Updated = "2018-08-20T09:58:39Z" },
                        new { Id = 341, Author = "Inga Berntsen Rudi", Content = "En resolusjon er et vedtak eller en uttalelse som en forsamling har gjort i fellesskap, og som alle medlemmene av forsamlingen stiller seg bak. For eksempel vedtar FN mange resolusjoner, særlig i Generalforsamlingen og i Sikkerhetsrådet. Eksempler på FN-resolusjoner er resolusjon 55/56 fra 2000 som etablerte en prosess som skulle sikre at diamanter blir kjøpt fra konfliktfrie områder, og resolusjon 61/255 fra 2007 som fordømte enhver fornektelse av holocaust.", Created = "2018-05-09T15:44:53Z", ExternalId = 61087, StatusId = 1, Title = "Resolusjon", Updated = "2018-09-04T06:47:06Z" },
                        new { Id = 342, Author = "Inga Berntsen Rudi", Content = "Ein resolusjon er eit vedtak eller ei fråsegn som ei forsamling har gjort i fellesskap, og som alle medlemmene av forsamlinga stiller seg bak. Til dømes vedtek FN mange resolusjonar, særleg i Generalforsamlinga og i Tryggingsrådet. Døme på FN-resolusjonar er resolusjon 55/56 frå 2000 som etablerte ein prosess som skulle sikre at diamantar blir kjøpte frå konfliktfrie område, og resolusjon 61/255 frå 2007 som fordømte all form for fornekting av holocaust.", Created = "2018-05-09T15:44:53Z", ExternalId = 61087, StatusId = 1, Title = "Resolusjon", Updated = "2018-09-04T06:47:06Z" },
                        new { Id = 242, Author = "Inga Berntsen Rudi", Content = "En norm er en regel eller et prinsipp som forbyr eller tillater en handling eller handlemåte. Det er en felles oppfattelse av hva som er godtatt eller ikke i et samfunn. Vi kan si at en norm er en rettesnor for hvordan vi skal oppføre oss. Normer kan være både formelle, nedskrevne lover og regler og uformelle og uskrevne. For eksempel har vi normer for bordskikk som ikke er skrevet ned.", Created = "2018-06-22T15:08:50Z", ExternalId = 5352, StatusId = 1, Title = "normer", Updated = "2018-08-20T10:28:43Z" },
                        new { Id = 243, Author = "Inga Berntsen Rudi", Content = "Ei norm er ein regel eller eit prinsipp som tillèt eller nektar ei handling eller ein handlemåte. Det er ei felles oppfatting av kva som er godteke eller ikkje i eit samfunn. Vi kan seie at ei norm er ei rettesnor for korleis vi skal oppføre oss. Normer kan vere både formelle, nedskrivne lover og reglar og uformelle og uskrivne. Til dømes har vi normer for bordskikk som ikkje er skrivne ned.", Created = "2018-06-22T15:08:50Z", ExternalId = 5352, StatusId = 1, Title = "normer", Updated = "2018-08-20T10:28:43Z" },
                        new { Id = 414, Author = "Inga Berntsen Rudi", Content = "Folkerett er rettsregler som er bindende i forholdet mellom stater. Man regner også med at enkeltpersoner (individer) og internasjonale organisasjoner kan være bundet av folkeretten.", Created = "2018-06-22T15:08:51Z", ExternalId = 5356, StatusId = 1, Title = "folkeretten", Updated = "2018-08-20T10:28:44Z" },
                        new { Id = 415, Author = "Inga Berntsen Rudi", Content = "Folkerett er rettsreglar som er bindande i forholdet mellom statar. Ein reknar også med at einskildpersonar (individ) og internasjonale organisasjonar kan vere bundne av folkeretten.", Created = "2018-06-22T15:08:51Z", ExternalId = 5356, StatusId = 1, Title = "folkeretten", Updated = "2018-08-20T10:28:44Z" },
                        new { Id = 123, Author = "Inga Berntsen Rudi", Content = "At noe er legitimt, betyr at det er rettmessig – noe som godtas som lovlig eller selvfølgelig.", Created = "2018-06-22T15:08:51Z", ExternalId = 9091, StatusId = 1, Title = "legitimt", Updated = "2018-08-20T10:28:45Z" },
                        new { Id = 124, Author = "Inga Berntsen Rudi", Content = "At noko er legitimt, tyder at det er rettmessig – noko som blir godteke som lovleg eller sjølvsagt.", Created = "2018-06-22T15:08:51Z", ExternalId = 9091, StatusId = 1, Title = "legitimt", Updated = "2018-08-20T10:28:45Z" },
                        new { Id = 373, Author = "Isak Nordeng Jensen", Content = "En avtale som Norge, Island og Liechtenstein har inngått med EU for å få tollfrihet for en rekke varer som vi ønsker å importere eller eksportere til land innenfor EU. Landbruksprodukter og fisk inngår ikke i EØS-avtalen.", Created = "2018-05-27T23:05:11Z", ExternalId = 167207, StatusId = 1, Title = "EØS-avtalen", Updated = "2018-08-20T10:26:19Z" },
                        new { Id = 374, Author = "Isak Nordeng Jensen", Content = "Ein avtale som Noreg, Island og Liechtenstein har inngått med EU for å få tollfridom for ei rekkje varer som vi ønskjer å importere eller eksportere til land innanfor EU. Landbruksprodukt og fisk er ikkje med i EØS-avtalen.", Created = "2018-05-27T23:05:11Z", ExternalId = 167207, StatusId = 1, Title = "EØS-avtalen", Updated = "2018-08-20T10:26:19Z" },
                        new { Id = 234, Author = "", Content = "Når en regjering stiller kabinettspørsmål, betyr det at den truer med å gå av dersom forslaget det gjelder, ikke blir vedtatt i Stortinget.", Created = "2018-05-09T15:17:33Z", ExternalId = 11257, StatusId = 1, Title = "kabinettspørsmål", Updated = "2018-09-04T08:51:48Z" },
                        new { Id = 235, Author = "", Content = "Når ei regjering stiller kabinettspørsmål, tyder det at ho trugar med å gå av dersom forslaget det gjeld, ikkje blir vedteke i Stortinget.", Created = "2018-05-09T15:17:33Z", ExternalId = 11257, StatusId = 1, Title = "kabinettspørsmål", Updated = "2018-09-04T08:51:48Z" },
                        new { Id = 523, Author = "", Content = "Direkte demokrati betyr at folket gjennom valg kan ta stilling til konkrete saker. Folkeavstemninger er eksempler på direkte demokrati.", Created = "2018-06-22T15:03:50Z", ExternalId = 11268, StatusId = 1, Title = "direkte demokrati", Updated = "2018-08-20T10:17:00Z" },
                        new { Id = 524, Author = "", Content = "Direkte demokrati tyder at folket gjennom val kan ta stilling til konkrete saker. Folkerøystingar er døme på direkte demokrati.", Created = "2018-06-22T15:03:50Z", ExternalId = 11268, StatusId = 1, Title = "direkte demokrati", Updated = "2018-08-20T10:17:00Z" },
                        new { Id = 404, Author = "", Content = "Representativt demokrati er en demokratisk styreform der de som skal ta politiske beslutninger, er valgt av folket. Representativt demokrati kalles ofte også for indirekte demokrati.", Created = "2018-06-22T15:03:25Z", ExternalId = 11212, StatusId = 1, Title = "representativt demokrati", Updated = "2018-08-20T10:19:17Z" },
                        new { Id = 405, Author = "", Content = "Representativt demokrati er ei demokratisk styreform der dei som skal ta politiske avgjerder, er valde av folket. Representativt demokrati kallast ofte også for indirekte demokrati.", Created = "2018-06-22T15:03:25Z", ExternalId = 11212, StatusId = 1, Title = "representativt demokrati", Updated = "2018-08-20T10:19:17Z" },
                        new { Id = 416, Author = "", Content = "Sivil ulydighet er en politisk aksjonsform som bryter loven, eller som er brudd på andre offentlige bestemmelser. Lovbruddene må være ikkevoldelige og avgrenset til en bestemt sak.", Created = "2018-06-22T15:03:03Z", ExternalId = 11301, StatusId = 1, Title = "sivil ulydighet", Updated = "2018-08-20T10:11:28Z" },
                        new { Id = 417, Author = "", Content = "Sivil ulydnad er ei politisk aksjonsform som bryt lova, eller som er brot på andre offentlege føresegner. Lovbrota må vere ikkjevaldelege og avgrensa til ei bestemd sak.", Created = "2018-06-22T15:03:03Z", ExternalId = 11301, StatusId = 1, Title = "sivil ulydnad", Updated = "2018-08-20T10:11:28Z" },
                        new { Id = 465, Author = "Inga Berntsen Rudi", Content = "En konvensjon er en avtale som også kan gå under navn som traktat eller pakt. Ofte er konvensjoner internasjonale. En internasjonal konvensjon er en avtale mellom stater hvor de statene som underskriver, forplikter seg til å respektere avtalen. Når en stat har skrevet under på en slik konvensjon, sier vi at staten har ratifisert konvensjonen. Da er konvensjonen folkerettslig bindende for den staten.", Created = "2018-06-22T14:59:34Z", ExternalId = 3515, StatusId = 1, Title = "Konvensjon", Updated = "2018-08-20T09:59:33Z" },
                        new { Id = 466, Author = "Inga Berntsen Rudi", Content = "Ein konvensjon er ein avtale som også kan gå under namn som traktat eller pakt. Ofte er konvensjonar internasjonale. Ein internasjonal konvensjon er ein avtale mellom statar. Dei statane som skriv under, bind seg til å respektere avtalen. Når ein stat har skrive under på ein slik konvensjon, seier vi at staten har ratifisert konvensjonen. Da er konvensjonen folkerettsleg bindande for den staten.", Created = "2018-06-22T14:59:34Z", ExternalId = 3515, StatusId = 1, Title = "Konvensjon", Updated = "2018-08-20T09:59:33Z" },
                        new { Id = 463, Author = "Inga Berntsen Rudi", Content = "Å ratifisere en avtale betyr å godkjenne den, eller å den gjøre gyldig. Hvis et land ratifiserer en avtale, betyr det at de godkjenner alle sider ved den og forplikter seg til å følge avtalen i ett og alt.", Created = "2018-06-22T14:59:33Z", ExternalId = 4483, StatusId = 1, Title = "Ratifisert", Updated = "2018-08-20T09:59:32Z" },
                        new { Id = 464, Author = "Inga Berntsen Rudi", Content = "Å ratifisere ein avtale vil seie å godkjenne han, eller å gjere han gyldig. Om eit land ratifiserer ein avtale, tyder det at dei godkjenner alle sider ved han og bind seg til å følgje avtalen i eitt og alt.", Created = "2018-06-22T14:59:33Z", ExternalId = 4483, StatusId = 1, Title = "Ratifisert", Updated = "2018-08-20T09:59:32Z" },
                        new { Id = 347, Author = "Inga Berntsen Rudi", Content = "Assimilering betyr \"å gjøre lik\". Assimilering beskrives gjerne som en politikk som en stat eller regjering fører overfor en språklig og kulturell minoritet for å gjøre den mest mulig lik flertallet i befolkningen. I Norge ble denne politikken ført overfor samene. Vi refererer også ofte til det som en fornorskningsprosess.", Created = "2018-05-04T21:29:02Z", ExternalId = 9710, StatusId = 1, Title = "Assimilering", Updated = "2018-09-04T08:50:57Z" },
                        new { Id = 348, Author = "Inga Berntsen Rudi", Content = "Assimilering tyder \"å gjere lik\". Assimilering blir gjerne forklart som ein politikk som ein stat eller ei regjering fører overfor ein språkleg og kulturell minoritet for å gjere han mest mogleg lik fleirtalet i befolkninga. I Noreg blei denne politikken ført overfor samane. Vi refererer også ofte til det som ein fornorskingsprosess.", Created = "2018-05-04T21:29:02Z", ExternalId = 9710, StatusId = 1, Title = "Assimilering", Updated = "2018-09-04T08:50:57Z" },
                        new { Id = 131, Author = "", Content = "Hovedavtalen (ofte kalt tariffavtalens del 1) er en avtale mellom arbeidsgiverorganisasjoner og arbeidstakerorganisasjoner. Den inneholder generelle bestemmelser om forhandlings- og samarbeidsforhold, men sier ikke noe om for eksempel lønn. Hovedavtalen kan for eksempel handle om de ansattes rett til informasjon, medbestemmelse og innsyn, og sikre retten til å ha tillitsvalgte som opptrer på arbeidstakernes vegne. Den sikrer også tillitsvalgte mot usaklig oppsigelse og trekker opp hvilke spilleregler som gjelder på arbeidsplassen for informasjon, samarbeid og konfliktløsning. Hovedavtalen gjelder normalt for fire år av gangen. Hovedavtalen i arbeidslivet er styrende for reguleringen av andre avtaler. Den første hovedavtalen i Norge ble inngått i 1935 mellom LO og N.A.F. (senere NHO). Kilde: Wikipedia", Created = "2018-05-09T15:21:18Z", ExternalId = 4228, StatusId = 1, Title = "Hovedavtalen", Updated = "2018-09-04T08:52:05Z" },
                        new { Id = 132, Author = "", Content = "Hovudavtalen (ofte kalla tariffavtalens del 1) er ein avtale mellom arbeidsgivarorganisasjonar og arbeidstakarorganisasjonar. Han inneheld generelle avtalepunkt om forhandlings- og samarbeidstilhøve, men seier ikkje noko om til dømes løn. Hovudavtalen kan til dømes handle om dei tilsette sin rett til informasjon, medråderett og innsyn, og sikre retten til å ha tillitsvalde som opptrer på vegner av arbeidstakarane. Han sikrar også tillitsvalde mot usakleg oppseiing og trekkjer opp kva for spelereglar som gjeld på arbeidsplassen for informasjon, samarbeid og konfliktløysing. Hovudavtalen gjeld normalt for fire år av gangen. Hovudavtalen i arbeidslivet er styrande for reguleringa av andre avtalar. Den første hovudavtalen i Noreg blei inngått i 1935 mellom LO og N.A.F. (seinare NHO). Kjelde: Wikipedia", Created = "2018-05-09T15:21:18Z", ExternalId = 4228, StatusId = 1, Title = "Hovudavtalen", Updated = "2018-09-04T08:52:05Z" },
                        new { Id = 218, Author = "Sissel Paaske", Content = "artikulert plattform; en plattform, f.eks. for lasting til havs, som er festet til et forankringspunkt på havbunnen via et kardangledd, slik at plattformen kan gi etter for strøm og vind uten å ta skade (SNL).", Created = "2018-06-22T15:43:44Z", ExternalId = 145913, StatusId = 1, Title = "artikulert", Updated = "2018-09-04T08:43:55Z" },
                        new { Id = 219, Author = "Sissel Paaske", Content = "artikulert plattform; en plattform, f.eks. for lasting til havs, som er festet til et forankringspunkt på havbunnen via et kardangledd, slik at plattformen kan gi etter for strøm og vind uten å ta skade (SNL).", Created = "2018-06-22T15:43:44Z", ExternalId = 145913, StatusId = 1, Title = "artikulert", Updated = "2018-09-04T08:43:55Z" },
                        new { Id = 311, Author = "Sissel Paaske", Content = "DHSV er forkortet fra Down Hole Safety Valve. Det er en ventil som monteres i øvre del av brønnen i produksjonsrøret. Ventilen holdes åpen av trykk gjennom en kontrollinje. Den er «fail safe close», som betyr at den stenger dersom trykket i kontrollinjen faller under et minimumsnivå. Ventilen er primærbarrieren i en produserende brønn.", Created = "2018-06-22T15:37:42Z", ExternalId = 178527, StatusId = 1, Title = "DHSV", Updated = "2018-09-04T08:43:46Z" },
                        new { Id = 312, Author = "Sissel Paaske", Content = "DHSV er forkortet fra Down Hole Safety Valve. Det er en ventil som monteres i øvre del av brønnen i produksjonsrøret. Ventilen holdes åpen av trykk gjennom en kontrollinje. Den er «fail safe close», som betyr at den stenger dersom trykket i kontrollinjen faller under et minimumsnivå. Ventilen er primærbarrieren i en produserende brønn.", Created = "2018-06-22T15:37:42Z", ExternalId = 178527, StatusId = 1, Title = "DHSV", Updated = "2018-09-04T08:43:46Z" },
                        new { Id = 162, Author = "Sissel Paaske", Content = "P/A: Plug and Abandon. Når BOP eller ventiltre skal fjernes fra brønnen (etter borefase eller produksjonsfase), må brønnen sikres med to plugger: en dyp og en grunn. I noen tilfeller er det en midlertidig plugging (temporary abandonment), andre ganger er det en permanent plugging.", Created = "2018-06-22T15:37:43Z", ExternalId = 177669, StatusId = 1, Title = "P/A", Updated = "2018-09-04T08:43:46Z" },
                        new { Id = 163, Author = "Sissel Paaske", Content = "P/A: Plug and Abandon. Når BOP eller ventiltre skal fjernes fra brønnen (etter borefase eller produksjonsfase), må brønnen sikres med to plugger: en dyp og en grunn. I noen tilfeller er det en midlertidig plugging (temporary abandonment), andre ganger er det en permanent plugging.", Created = "2018-06-22T15:37:43Z", ExternalId = 177669, StatusId = 1, Title = "P/A", Updated = "2018-09-04T08:43:46Z" },
                        new { Id = 273, Author = "Sissel Paaske", Content = "Å perforere en brønn vil si at det skytes flere hull i røret som skiller brønnen fra reservoaret. Perforering utføres ved hjelp av mange små eksplosiver som aktiviseres når de er kjørt inn i brønnen til riktig sted.", Created = "2018-06-22T15:44:54Z", ExternalId = 177921, StatusId = 1, Title = "Perforere en brønn", Updated = "2018-09-04T08:43:52Z" },
                        new { Id = 274, Author = "Sissel Paaske", Content = "Å perforere en brønn vil si at det skytes flere hull i røret som skiller brønnen fra reservoaret. Perforering utføres ved hjelp av mange små eksplosiver som aktiviseres når de er kjørt inn i brønnen til riktig sted.", Created = "2018-06-22T15:44:54Z", ExternalId = 177921, StatusId = 1, Title = "Perforere en brønn", Updated = "2018-09-04T08:43:52Z" },
                        new { Id = 406, Author = "Sissel Paaske", Content = "Assembly er engelsk og betyr montering. Ordet brukes om komponenter som monteres sammen i en lengre enhet for å brukes til boring eller brønnaktiviteter. Et assembly dokumenteres på en liste med tekst og tegning som viser hvor hver komponent er, og de ytre og indre målene.", Created = "2018-06-22T15:41:06Z", ExternalId = 178004, StatusId = 1, Title = "Assembly", Updated = "2018-09-04T08:44:06Z" },
                        new { Id = 407, Author = "Sissel Paaske", Content = "Assembly er engelsk og betyr montering. Ordet brukes om komponenter som monteres sammen i en lengre enhet for å brukes til boring eller brønnaktiviteter. Et assembly dokumenteres på en liste med tekst og tegning som viser hvor hver komponent er, og de ytre og indre målene.", Created = "2018-06-22T15:41:06Z", ExternalId = 178004, StatusId = 1, Title = "Assembly", Updated = "2018-09-04T08:44:06Z" },
                        new { Id = 198, Author = "Sissel Paaske", Content = "Fiskenakken er utformingen i den øvre delen av hver komponent. Den skal være utformet slik at det er mulig å ta tak i komponenten med et fiskevertøy og hente komponenten ut av brønnen.", Created = "2018-06-22T15:44:46Z", ExternalId = 178002, StatusId = 1, Title = "Fiskenakke", Updated = "2018-09-04T08:44:04Z" },
