                        new { Id = 398, Author = "Sissel Paaske", Content = "Roller cone bit, også kjent som rock bit, er en borekrone med tre kjegler som ruller mot formasjonen og knuser den til mindre biter. På norsk kalles den ofte rulleborekrone.", Created = "2018-06-22T15:37:56Z", ExternalId = 177837, StatusId = 1, Title = "Roller cone bit", Updated = "2018-09-04T08:44:06Z" },
