                        new { Id = 410, Author = "Sissel Paaske", Content = "Riser er det engelske ordet for stigerør. Riser er en midlertidig rørforlengelse av brønnen fra brønnhodet til overflaten (rigg). Det finnes ulike typer riser: drilling riser med stor dimensjon, work-over riser med noe mindre dimensjon, og production riser som er en permanent forlengelse av brønnen.", Created = "2018-06-22T15:37:52Z", ExternalId = 177831, StatusId = 1, Title = "Riser (stigerør)", Updated = "2018-09-04T08:43:55Z" },
