                        new { Id = 497, Author = "Sissel Paaske", Content = "Kick off point (KOP) er det dypet i brønnen der vinkelen skal økes eller reduseres fra den retningen brønnen har. En brønn kan ha mange KOP, ett for hver retningsendring.", Created = "2018-06-22T15:37:54Z", ExternalId = 177789, StatusId = 1, Title = "Kick off point (KOP)", Updated = "2018-09-04T08:44:01Z" },
