                        new { Id = 72, Author = "Johannes Leiknes Nag", Content = "Personas er liksompersoner definert ut fra ulik alder, kjønn og interesser, som brukes for å undersøke hvordan ulike brukere opplever navigasjonen på et nettsted. Personas brukes i planlegging av nettsteder og app-er.", Created = "2018-05-04T14:09:25Z", ExternalId = 173858, StatusId = 1, Title = "Personas", Updated = "2018-05-27T15:36:16Z" },
                        new { Id = 73, Author = "Johannes Leiknes Nag", Content = "Personas er liksompersonar definerte ut frå ulik alder, kjønn og interesser, som blir brukte for å undersøkje korleis ulike brukarar opplever navigasjonen på ein nettstad. Personas blir brukt i planlegging av nettstader og app-ar.", Created = "2018-05-04T14:09:25Z", ExternalId = 173858, StatusId = 1, Title = "Personas", Updated = "2018-05-27T15:36:16Z" },
