                        new { Id = 12, Author = "Johannes Leiknes Nag", Content = "Ein brukarsti er ei førestilling om korleis ein typisk person vil komme til å bruke ein nettstad, leite og finne fram. Brukarstiar blir brukte i planlegging av nettstader og app-ar.", Created = "2018-05-04T14:09:26Z", ExternalId = 173857, StatusId = 1, Title = "Brukarsti", Updated = "2018-05-27T15:36:17Z" },
