                        new { Id = 7, Author = "Johannes Leiknes Nag", Content = "Universell utforming er å forme omgivelsene slik at vi tar hensyn til variasjonen i funksjonsevne hos innbyggerne, inkludert personer med nedsatt funksjonsevne.", Created = "2018-05-04T14:09:27Z", ExternalId = 173854, StatusId = 1, Title = "Universell utforming/UU", Updated = "2018-05-27T15:36:18Z" },
