                        new { Id = 299, Author = "Sissel Paaske", Content = "MWD er forkortelse for Measurement While Drilling. Det er et verktøy som brukes i bunnen av borestrengen (i BHA) til å registrere retningen på brønnbanen. Retningen registreres både vertikalt og horisontalt. Informasjonen om retningen sendes til overflaten gjennom pulser i boreslammet. På overflaten ser retningsboreren brønnbanen på en skjerm.", Created = "2018-06-22T15:35:27Z", ExternalId = 176573, StatusId = 1, Title = "MWD", Updated = "2018-09-04T08:43:36Z" },
                        new { Id = 300, Author = "Sissel Paaske", Content = "MWD er forkortelse for Measurement While Drilling. Det er et verktøy som brukes i bunnen av borestrengen (i BHA) til å registrere retningen på brønnbanen. Retningen registreres både vertikalt og horisontalt. Informasjonen om retningen sendes til overflaten gjennom pulser i boreslammet. På overflaten ser retningsboreren brønnbanen på en skjerm.", Created = "2018-06-22T15:35:27Z", ExternalId = 176573, StatusId = 1, Title = "MWD", Updated = "2018-09-04T08:43:36Z" },
