                        new { Id = 186, Author = "Sissel Paaske", Content = "Overlagring beskriver hvordan lag på lag med avsetninger og sedimentære bergarter ligger over en bergart i dypet.", Created = "2018-06-22T15:28:58Z", ExternalId = 175464, StatusId = 1, Title = "Overlagring", Updated = "2018-08-17T14:15:16Z" },
