                        new { Id = 90, Author = "Sissel Paaske", Content = "Delta dannes av elveavsetninger (elvedelta, elveos). I området der elven ender i stillestående vann eller hav, avsettes sedimenter som danner kanaler og endringer i retningene utløpet tar. Typiske former er vifteform og fuglefot.", Created = "2018-06-22T15:28:47Z", ExternalId = 175462, StatusId = 1, Title = "Delta", Updated = "2018-08-17T14:15:27Z" },
