                        new { Id = 250, Author = "Sissel Paaske", Content = "Casing er engelsk og betyr fôringsrør. Rørene skrus sammen og brukes til å sikre borehullet. Casingen går helt opp i brønnen. For hver nye seksjon som bores ut, installeres en mindre casing innvendig i den forrige. Casing sementeres i nederste del. Casing skilles fra andre rør på størrelsen, mindre rør kalles tubing på engelsk.", Created = "2018-06-22T15:37:45Z", ExternalId = 175426, StatusId = 1, Title = "Casing", Updated = "2018-09-04T08:44:14Z" },
                        new { Id = 251, Author = "Sissel Paaske", Content = "Casing er engelsk og betyr fôringsrør. Rørene skrus sammen og brukes til å sikre borehullet. Casingen går helt opp i brønnen. For hver nye seksjon som bores ut, installeres en mindre casing innvendig i den forrige. Casing sementeres i nederste del. Casing skilles fra andre rør på størrelsen, mindre rør kalles tubing på engelsk.", Created = "2018-06-22T15:37:45Z", ExternalId = 175426, StatusId = 1, Title = "Casing", Updated = "2018-09-04T08:44:14Z" },
                        new { Id = 76, Author = "Emily Sørensen", Content = "Avtale mellom en fagforening og en arbeidsgiver om arbeids- og lønnsvilkår. En tariffavtale gjelder for en bestemt tidsperiode og er forskjellig fra bransje til bransje.", Created = "2018-05-27T16:37:10Z", ExternalId = 167361, StatusId = 1, Title = "Tariffavtale", Updated = "2018-09-04T08:50:56Z" },
                        new { Id = 77, Author = "Emily Sørensen", Content = "Avtale mellom ei fagforeining og ein arbeidsgivar om arbeids- og lønnsvilkår. Ein tariffavtale gjeld for ein bestemt tidsperiode og er ulik frå bransje til bransje.", Created = "2018-05-27T16:37:10Z", ExternalId = 167361, StatusId = 1, Title = "Tariffavtale", Updated = "2018-09-04T08:50:56Z" },
                        new { Id = 265, Author = "Sissel Paaske", Content = "Forvitring kommer fra det tyske ordet «Wetter» som betyr vær. På engelsk omtales forvitring som \"weathering\". Forvitring er altså nedbryting av bergarter på grunn av vær: vann, vind og temperatur.", Created = "2018-06-22T15:28:45Z", ExternalId = 175244, StatusId = 1, Title = "Forvitring", Updated = "2018-08-17T14:12:47Z" },
                        new { Id = 266, Author = "Sissel Paaske", Content = "Forvitring kommer fra det tyske ordet «Wetter» som betyr vær. På engelsk omtales forvitring som \"weathering\". Forvitring er altså nedbryting av bergarter på grunn av vær: vann, vind og temperatur.", Created = "2018-06-22T15:28:45Z", ExternalId = 175244, StatusId = 1, Title = "Forvitring", Updated = "2018-08-17T14:12:47Z" },
                        new { Id = 230, Author = "Kristin Bøhle", Content = "Vassmolekyl er polare. Det vil seie at dei har ei ladningsforskyving, men ingen netto ladning. Vassmolekyl har ei positiv og ei negativ side (pol), fordi oksygen og hydrogen trekkjer ulikt på dei felles elektronpara.", Created = "2018-06-22T15:36:00Z", ExternalId = 134394, StatusId = 1, Title = "Polare vassmolekyl", Updated = "2018-09-04T08:43:33Z" },
                        new { Id = 231, Author = "Kristin Bøhle", Content = "Vannmolekyler er polare. Det vil si at de har en ladningsforskyvning, men ingen netto ladning. Vannmolekyler har en positiv og negativ side (pol) fordi oksygen og hydrogen trekker ulikt på de felles elektronparene.", Created = "2018-06-22T15:36:00Z", ExternalId = 134394, StatusId = 1, Title = "Polare vannmolekyler", Updated = "2018-09-04T08:43:33Z" },
                        new { Id = 27, Author = "Sigurd Alnæs", Content = "Eit problem du kan løyse enkelt, raskt og nøyaktig. Ein ”byggjestein” som du kan bruke når du skal løyse meir komplekse problem. Du deler opp hovudproblemet i mindre primitivar, og løyser dei enkelt. Eit døme på ein primitiv er gongetabellen. Har du lært han, slepp du å tenkje på korleis du løyser 8 x 7. Du veit med ein gong at det er 56. Sjå òg", Created = "2018-05-04T14:59:12Z", ExternalId = 48108, StatusId = 1, Title = "Primitiv", Updated = "2018-05-04T15:00:05Z" },
                        new { Id = 28, Author = "Sigurd Alnæs", Content = "Et problem du kan løse enkelt, raskt og nøyaktig. En ”byggestein” som du kan bruke når du skal løse mer komplekse problemer. Du deler opp hovedproblemet i mindre primitiver og løser dem enkelt. Et eksempel på en primitiv er gangetabellen. Har du lært den, slipper du å tenke på hvordan du løser 8 x 7. Du vet med en gang at det er 56. Se også", Created = "2018-05-04T14:59:12Z", ExternalId = 48108, StatusId = 1, Title = "Primitiv", Updated = "2018-05-04T15:00:05Z" },
                        new { Id = 212, Author = "Sissel Paaske", Content = "Primærbarrieren i en brønn er den hindringen som ligger nærmest kilden (reservoaret). I forbindelse med bore- og brønnaktivitet er primærbarrieren væsken som står i brønnen. Når brønnen produserer, er det kompletteringen med sikringsventilen (DHSV) i brønnen som er primærbarrieren.", Created = "2018-06-22T15:37:31Z", ExternalId = 174263, StatusId = 1, Title = "Primærbarriere", Updated = "2018-09-04T08:44:03Z" },
                        new { Id = 213, Author = "Sissel Paaske", Content = "Primærbarrieren i en brønn er den hindringen som ligger nærmest kilden (reservoaret). I forbindelse med bore- og brønnaktivitet er primærbarrieren væsken som står i brønnen. Når brønnen produserer, er det kompletteringen med sikringsventilen (DHSV) i brønnen som er primærbarrieren.", Created = "2018-06-22T15:37:31Z", ExternalId = 174263, StatusId = 1, Title = "Primærbarriere", Updated = "2018-09-04T08:44:03Z" },
                        new { Id = 277, Author = "Sissel Paaske", Content = "Sikkerhetsmargin er et tillegg over eller under et mål som gjør at man har noe spillerom før grensen er nådd.", Created = "2018-06-22T15:37:25Z", ExternalId = 174241, StatusId = 1, Title = "Sikkerhetsmargin ", Updated = "2018-09-04T08:43:47Z" },
                        new { Id = 278, Author = "Sissel Paaske", Content = "Sikkerhetsmargin er et tillegg over eller under et mål som gjør at man har noe spillerom før grensen er nådd.", Created = "2018-06-22T15:37:25Z", ExternalId = 174241, StatusId = 1, Title = "Sikkerhetsmargin ", Updated = "2018-09-04T08:43:47Z" },
                        new { Id = 246, Author = "Sissel Paaske", Content = "Choke line og kill line i BOP er linjer (rør) som går inn i BOP fra overflaten. Linjene brukes til å sirkulere væske inn og ut fra ringrommet når en ventil i BOP er stengt over koblingspunktet til choke line og kill line. Choke line brukes til utsirkulering, og kill line til innsirkulering av væske.", Created = "2018-06-22T15:37:30Z", ExternalId = 174238, StatusId = 1, Title = "Choke line og kill line på BOP", Updated = "2018-09-04T08:43:58Z" },
                        new { Id = 247, Author = "Sissel Paaske", Content = "Choke line og kill line i BOP er linjer (rør) som går inn i BOP fra overflaten. Linjene brukes til å sirkulere væske inn og ut fra ringrommet når en ventil i BOP er stengt over koblingspunktet til choke line og kill line. Choke line brukes til utsirkulering, og kill line til innsirkulering av væske.", Created = "2018-06-22T15:37:30Z", ExternalId = 174238, StatusId = 1, Title = "Choke line og kill line på BOP", Updated = "2018-09-04T08:43:58Z" },
                        new { Id = 400, Author = "Emily Sørensen", Content = "En pengestøtte som blir gitt til foreldre med barn mellom ett og to år som ikke går i barnehage. Støtten kan tidligst bli gitt fra måneden etter at barnet har fylt ett år, og kan maksimalt gis til og med måneden før barnet fyller to år, dvs. maksimalt 11 måneder.", Created = "2018-06-22T15:06:20Z", ExternalId = 167266, StatusId = 1, Title = "Kontantstøtte", Updated = "2018-08-17T19:10:43Z" },
                        new { Id = 401, Author = "Emily Sørensen", Content = "Ei pengestøtte som blir gitt til foreldre med barn mellom eitt og to år som ikkje går i barnehage. Støtta kan tidlegast bli gitt frå månaden etter at barnet har fylt eitt år, og kan maksimalt bli utbetalt til og med månaden før barnet fyller to år, dvs. maksimalt 11 månader.", Created = "2018-06-22T15:06:20Z", ExternalId = 167266, StatusId = 1, Title = "Kontantstøtte", Updated = "2018-08-17T19:10:43Z" },
                        new { Id = 96, Author = "Isak Nordeng Jensen", Content = "Mødre kan få engangsstønad ved fødsel og adopsjon hvis de ikke har rett til foreldrepenger. Hvis en far er alene om omsorgen, kan også han ha rett til engangsstønad.", Created = "2018-06-22T15:06:21Z", ExternalId = 167189, StatusId = 1, Title = "Engangsstønad", Updated = "2018-08-17T19:10:46Z" },
                        new { Id = 97, Author = "Isak Nordeng Jensen", Content = "Mødrer kan få eingongsstønad ved fødsel og adopsjon dersom dei ikkje har rett til foreldrepengar. Dersom ein far er åleine om omsorga, kan også han ha rett til eingongsstønad.", Created = "2018-06-22T15:06:21Z", ExternalId = 167189, StatusId = 1, Title = "Eingongsstønad", Updated = "2018-08-17T19:10:46Z" },
                        new { Id = 469, Author = "Liv Dagrunn Andreassen", Content = "Geologiske lag er lagene som dannes gjennom millioner av år av ulike typer sedimenter som er avsatt på havbunnen. Sedimentene er da blitt omdannet til forskjellige bergarter som ligger lag på lag. Skillet mellom disse ulike bergartene er grensene som påvises i seismiske undersøkelser. Dypet og vinkelen til disse grensene er endret fra opprinnelig posisjon på grunn av blant annet foldinger, forkastninger og saltdiapirer.", Created = "2018-06-22T15:29:38Z", ExternalId = 173987, StatusId = 1, Title = "Geologiske lag", Updated = "2018-08-17T14:17:19Z" },
                        new { Id = 470, Author = "Liv Dagrunn Andreassen", Content = "Geologiske lag er lagene som dannes gjennom millioner av år av ulike typer sedimenter som er avsatt på havbunnen. Sedimentene er da blitt omdannet til forskjellige bergarter som ligger lag på lag. Skillet mellom disse ulike bergartene er grensene som påvises i seismiske undersøkelser. Dypet og vinkelen til disse grensene er endret fra opprinnelig posisjon på grunn av blant annet foldinger, forkastninger og saltdiapirer.", Created = "2018-06-22T15:29:38Z", ExternalId = 173987, StatusId = 1, Title = "Geologiske lag", Updated = "2018-08-17T14:17:19Z" },
                        new { Id = 248, Author = "Liv Dagrunn Andreassen", Content = "Fjernstyrt undervannsfarkost (ROV, fra engelsk Remotely Operated Vehicle) er en robot som blir fjernstyrt fra kontrollrom på skip eller plattform. ROV brukes til kartlegging av havbunn, inspeksjon, vedlikehold og reparasjon av havbunnsinstallasjoner og lignende. Den kan operere ned til ca. 3000 meter og i helt spesielle tilfeller ned til 7000–8000 meter. Fjernstyrte undervannsfarkoster utfører i dag mange oppgaver som før krevde dykkere. Operatøren som flyr en ROV, kalles pilot.", Created = "2018-06-22T15:37:55Z", ExternalId = 173533, StatusId = 1, Title = "ROV", Updated = "2018-09-04T08:44:04Z" },
                        new { Id = 249, Author = "Liv Dagrunn Andreassen", Content = "Fjernstyrt undervannsfarkost (ROV, fra engelsk Remotely Operated Vehicle) er en robot som blir fjernstyrt fra kontrollrom på skip eller plattform. ROV brukes til kartlegging av havbunn, inspeksjon, vedlikehold og reparasjon av havbunnsinstallasjoner og lignende. Den kan operere ned til ca. 3000 meter og i helt spesielle tilfeller ned til 7000–8000 meter. Fjernstyrte undervannsfarkoster utfører i dag mange oppgaver som før krevde dykkere. Operatøren som flyr en ROV, kalles pilot.", Created = "2018-06-22T15:37:55Z", ExternalId = 173533, StatusId = 1, Title = "ROV", Updated = "2018-09-04T08:44:04Z" },
                        new { Id = 214, Author = "Liv Dagrunn Andreassen", Content = "Av de greske ordene lithos; stein og logi; lære). Beskrivelse og klassifikasjon av bergarter, særlig sedimentære bergarter som sandstein, kalkstein og leirskifer.", Created = "2018-06-22T15:35:40Z", ExternalId = 173531, StatusId = 1, Title = "Litologi", Updated = "2018-09-04T08:43:44Z" },
                        new { Id = 215, Author = "Liv Dagrunn Andreassen", Content = "Av de greske ordene lithos; stein og logi; lære). Beskrivelse og klassifikasjon av bergarter, særlig sedimentære bergarter som sandstein, kalkstein og leirskifer.", Created = "2018-06-22T15:35:40Z", ExternalId = 173531, StatusId = 1, Title = "Litologi", Updated = "2018-09-04T08:43:44Z" },
                        new { Id = 443, Author = "Sissel Paaske", Content = "GOC, gas-oil contact, viser til dybden i et reservoar der bunnen av gassen møter toppen av oljen.", Created = "2018-07-06T14:42:41Z", ExternalId = 172924, StatusId = 1, Title = "GOC – gas-oil contact", Updated = "2018-09-04T08:43:28Z" },
                        new { Id = 444, Author = "Sissel Paaske", Content = "GOC, gas-oil contact, viser til dybden i et reservoar der bunnen av gassen møter toppen av oljen.", Created = "2018-07-06T14:42:41Z", ExternalId = 172924, StatusId = 1, Title = "GOC – gas-oil contact", Updated = "2018-09-04T08:43:28Z" },
                        new { Id = 519, Author = "Sissel Paaske", Content = "OWC, oil-water contact, viser til dybden i et reservoar der bunnen av oljen møter toppen av formasjonsvannet. OWC flytter seg oppover eller mot brønnen når reservoaret dreneres for olje.", Created = "2018-07-06T14:42:42Z", ExternalId = 172923, StatusId = 1, Title = "OWC – oil-water contact", Updated = "2018-09-04T08:43:31Z" },
                        new { Id = 520, Author = "Sissel Paaske", Content = "OWC, oil-water contact, viser til dybden i et reservoar der bunnen av oljen møter toppen av formasjonsvannet. OWC flytter seg oppover eller mot brønnen når reservoaret dreneres for olje.", Created = "2018-07-06T14:42:42Z", ExternalId = 172923, StatusId = 1, Title = "OWC – oil-water contact", Updated = "2018-09-04T08:43:31Z" },
                        new { Id = 110, Author = "Sissel Paaske", Content = "Kryssproduksjon er når en brønn har høyere trykk enn en annen, slik at produsert væske går ned i lavtrykkbrønnen i stedet for videre inn i produksjonsrøret. Kryssproduksjonen skjer i møtepunktet mellom brønnene (manifolden) før videre transport til produksjonsrøret. For å hindre kryssproduksjon kan man strupe produksjonen fra høytrykksbrønnen foran manifolden.", Created = "2018-06-22T15:42:26Z", ExternalId = 172660, StatusId = 1, Title = "Kryssproduksjon ", Updated = "2018-09-04T08:43:42Z" },
                        new { Id = 111, Author = "Sissel Paaske", Content = "Kryssproduksjon er når en brønn har høyere trykk enn en annen, slik at produsert væske går ned i lavtrykkbrønnen i stedet for videre inn i produksjonsrøret. Kryssproduksjonen skjer i møtepunktet mellom brønnene (manifolden) før videre transport til produksjonsrøret. For å hindre kryssproduksjon kan man strupe produksjonen fra høytrykksbrønnen foran manifolden.", Created = "2018-06-22T15:42:26Z", ExternalId = 172660, StatusId = 1, Title = "Kryssproduksjon ", Updated = "2018-09-04T08:43:42Z" },
                        new { Id = 402, Author = "Sissel Paaske", Content = "Pilothull kommer fra det engelske verbet to pilot; å lede. Pilothull er boring av et hull i to steg, først med liten diameter, deretter med den større diameteren. Et pilothull bores i områder med ukjente forhold. Dersom det er gass vil konsekvensene av en utstrømning være betydelig mindre, enn med stort hull. Det er også lettere å gjenvinne kontrollen med å pumpe væske med høy hastighet i et lite hull, fordi det skaper friksjon som virker mot utstrømningen.", Created = "2018-06-22T15:34:47Z", ExternalId = 172679, StatusId = 1, Title = "Pilothull ", Updated = "2018-09-04T08:43:39Z" },
                        new { Id = 403, Author = "Sissel Paaske", Content = "Pilothull kommer fra det engelske verbet to pilot; å lede. Pilothull er boring av et hull i to steg, først med liten diameter, deretter med den større diameteren. Et pilothull bores i områder med ukjente forhold. Dersom det er gass, vil konsekvensene av en utstrømning være betydelig mindre enn med stort hull. Det er også lettere å gjenvinne kontrollen med å pumpe væske med høy hastighet i et lite hull, fordi det skaper friksjon som virker mot utstrømningen.", Created = "2018-06-22T15:34:47Z", ExternalId = 172679, StatusId = 1, Title = "Pilothull ", Updated = "2018-09-04T08:43:39Z" },
                        new { Id = 495, Author = "Sissel Paaske", Content = "Boreparameter er et samlebegrep for verdier som er viktige å overvåke under boring. De vanligste vi overvåker, er framdriften, rate of penetration (ROP), vekten på borekronen, weight on bit (WOB), og friksjonen mot rotasjon på borekronen, torque. Endringer i boreparametrene som ikke er forårsaket av endringer fra borerens kontrollpanel, kan bety at man borer inn i høytrykksone eller får kick inn i brønnen.", Created = "2018-06-22T15:34:48Z", ExternalId = 172685, StatusId = 1, Title = "Boreparameter ", Updated = "2018-09-04T08:43:41Z" },
                        new { Id = 496, Author = "Sissel Paaske", Content = "Boreparameter er et samlebegrep for verdier som er viktige å overvåke under boring. De vanligste vi overvåker, er framdriften, rate of penetration (ROP), vekten på borekronen, weight on bit (WOB), og friksjonen mot rotasjon på borekronen, torque. Endringer i boreparametrene som ikke er forårsaket av endringer fra borerens kontrollpanel, kan bety at man borer inn i høytrykksone eller får kick inn i brønnen.", Created = "2018-06-22T15:34:48Z", ExternalId = 172685, StatusId = 1, Title = "Boreparameter ", Updated = "2018-09-04T08:43:41Z" },
                        new { Id = 301, Author = "Sissel Paaske", Content = "Solenoidventil er en magnetisk spoleventil som opereres med elektrisk spenning. Når det tilføres spenning, endres den magnetiske retningen i spolen slik at ventilens posisjon endres. Når spenningen fjernes, er det en fjær som bringer ventilen til motsatt posisjon.", Created = "2018-06-22T15:42:34Z", ExternalId = 172662, StatusId = 1, Title = "Solenoidventil ", Updated = "2018-09-04T08:43:41Z" },
                        new { Id = 302, Author = "Sissel Paaske", Content = "Solenoidventil er en magnetisk spoleventil som opereres med elektrisk spenning. Når det tilføres spenning, endres den magnetiske retningen i spolen slik at ventilens posisjon endres. Når spenningen fjernes, er det en fjær som bringer ventilen til motsatt posisjon.", Created = "2018-06-22T15:42:34Z", ExternalId = 172662, StatusId = 1, Title = "Solenoidventil ", Updated = "2018-09-04T08:43:41Z" },
                        new { Id = 515, Author = "Liv Dagrunn Andreassen", Content = "Den indre kraften i bergarten som må til for å holde massen av bergartene som ligger over. Dypereliggende formasjoner er sterkere enn grunne bergarter på grunn av herdeprosessen som pågår over millioner av år. Når vi drenerer væske ut av porene i bergarten påvirker det den indre styrken slik at bergarten svekkes.", Created = "2018-06-22T15:35:31Z", ExternalId = 172158, StatusId = 1, Title = "Formasjonsstyrke", Updated = "2018-09-04T08:43:30Z" },
                        new { Id = 516, Author = "Liv Dagrunn Andreassen", Content = "Den indre kraften i bergarten som må til for å holde massen av bergartene som ligger over. Dypereliggende formasjoner er sterkere enn grunne bergarter på grunn av herdeprosessen som pågår over millioner av år. Når vi drenerer væske ut av porene i bergarten påvirker det den indre styrken slik at bergarten svekkes.", Created = "2018-06-22T15:35:31Z", ExternalId = 172158, StatusId = 1, Title = "Formasjonsstyrke", Updated = "2018-09-04T08:43:30Z" },
                        new { Id = 367, Author = "Sissel Paaske", Content = "En godt konsolidert bergart har en sterk forbindelse eller binding av mineraler mellom sedimentene i bergarten. Bindingene i løse bergarter og avleiringer oppstår ved hjelp av trykkpåvirkning, sammenpressing, omkrystallisering og sementering av sedimentene med nydannede mineraler. Dersom bergarten er løs og faller fra hverandre ved lett belastning, er den dårlig konsolidert.", Created = "2018-06-22T15:29:01Z", ExternalId = 171174, StatusId = 1, Title = "Konsolidert bergart", Updated = "2018-09-04T08:43:58Z" },
                        new { Id = 368, Author = "Sissel Paaske", Content = "En godt konsolidert bergart har en sterk forbindelse eller binding av mineraler mellom sedimentene i bergarten. Bindingene i løse bergarter og avleiringer oppstår ved hjelp av trykkpåvirkning, sammenpressing, omkrystallisering og sementering av sedimentene med nydannede mineraler. Dersom bergarten er løs og faller fra hverandre ved lett belastning, er den dårlig konsolidert.", Created = "2018-06-22T15:29:01Z", ExternalId = 171174, StatusId = 1, Title = "Konsolidert bergart", Updated = "2018-09-04T08:43:58Z" },
                        new { Id = 329, Author = "Sissel Paaske", Content = "Pallebord er et bord som kan beveges vertikalt opp og ned. Det brukes til å løfte paller med kjemikalier for mixing av borevæske.", Created = "2018-06-22T15:32:16Z", ExternalId = 168492, StatusId = 1, Title = "Pallebord", Updated = "2018-08-17T14:22:27Z" },
                        new { Id = 330, Author = "Sissel Paaske", Content = "Pallebord er et bord som kan beveges vertikalt opp og ned. Det brukes til å løfte paller med kjemikalier for mixing av borevæske.", Created = "2018-06-22T15:32:16Z", ExternalId = 168492, StatusId = 1, Title = "Pallebord", Updated = "2018-08-17T14:22:27Z" },
                        new { Id = 78, Author = "Sissel Paaske", Content = "ppm; parts per million. Måleenhet som vanligvis brukes for konsentrasjon av et stoff i et annet, der små mengder er påviselige og muligens viktige.", Created = "2018-06-22T15:42:09Z", ExternalId = 150257, StatusId = 1, Title = "ppm", Updated = "2018-09-04T08:43:50Z" },
                        new { Id = 79, Author = "Sissel Paaske", Content = "ppm; parts per million. Måleenhet som vanligvis brukes for konsentrasjon av et stoff i et annet, der små mengder er påviselige og muligens viktige.", Created = "2018-06-22T15:42:09Z", ExternalId = 150257, StatusId = 1, Title = "ppm", Updated = "2018-09-04T08:43:50Z" },
                        new { Id = 441, Author = "Sissel Paaske", Content = "Norsk olje og gass er en interesse- og arbeidsgiverorganisasjon for oljeselskaper og leverandørbedrifter knyttet til utforsking og produksjon av olje og gass på norsk kontinentalsokkel. Norsk olje og gass er en landsforening i NHO, Næringslivets Hovedorganisasjon.", Created = "2018-06-22T15:45:35Z", ExternalId = 168316, StatusId = 1, Title = "Norsk olje og gass", Updated = "2018-09-04T08:43:53Z" },
                        new { Id = 442, Author = "Sissel Paaske", Content = "Norsk olje og gass er en interesse- og arbeidsgiverorganisasjon for oljeselskaper og leverandørbedrifter knyttet til utforsking og produksjon av olje og gass på norsk kontinentalsokkel. Norsk olje og gass er en landsforening i NHO, Næringslivets Hovedorganisasjon.", Created = "2018-06-22T15:45:35Z", ExternalId = 168316, StatusId = 1, Title = "Norsk olje og gass", Updated = "2018-09-04T08:43:53Z" },
                        new { Id = 297, Author = "Emily Sørensen", Content = "Forskjellsbehandling som får negative konsekvenser for den eller dem det gjelder Direkte diskriminering: når en person blir behandlet dårligere enn en annen på grunn av kjønn, etnisk bakgrunn, seksuell orientering, funksjonsevne osv. Indirekte diskriminering: når en tilsynelatende nøytral praksis fører til at en person behandles dårligere enn en annen på grunn av kjønn, etnisk bakgrunn, seksuell orientering, funksjonsevne osv.", Created = "2018-06-22T14:57:46Z", ExternalId = 167387, StatusId = 1, Title = "Diskriminering", Updated = "2018-08-17T16:09:49Z" },
                        new { Id = 298, Author = "Emily Sørensen", Content = "Forskjellsbehandling som får negative konsekvensar for den eller dei det gjeld Direkte diskriminering: når ein person blir behandla dårlegare enn ein annan på grunn av kjønn, etnisk bakgrunn, seksuell orientering, funksjonsevne osv. Indirekte diskriminering: når ein tilsynelatande nøytral praksis fører til at ein person blir behandla dårlegare enn ein annan på grunn av kjønn, etnisk bakgrunn, seksuell orientering, funksjonsevne osv.", Created = "2018-06-22T14:57:46Z", ExternalId = 167387, StatusId = 1, Title = "Diskriminering", Updated = "2018-08-17T16:09:49Z" },
                        new { Id = 293, Author = "Emily Sørensen", Content = "Sosiale prosesser som fører til at individet tilegner seg og tar opp i seg uskrevne og skrevne normer og regler i samfunnet Primærsosialisering: sosialisering i hjemmet og privatsfæren Sekundærsosialisering: sosialisering i det offentlige rommet, for eksempel på skolen eller på fotballaget.", Created = "2018-06-22T14:57:47Z", ExternalId = 167349, StatusId = 1, Title = "Sosialisering", Updated = "2018-08-17T16:09:52Z" },
                        new { Id = 294, Author = "Emily Sørensen", Content = "Sosiale prosessar som fører til at individet tileignar seg og tek opp i seg uskrivne og skrivne normer og reglar i samfunnet Primærsosialisering: sosialisering i heimen og privatsfæren Sekundærsosialisering: sosialisering i det offentlege rommet, til dømes på skulen eller på fotballaget.", Created = "2018-06-22T14:57:47Z", ExternalId = 167349, StatusId = 1, Title = "Sosialisering", Updated = "2018-08-17T16:09:52Z" },
