                        new { Id = 263, Author = "Emily Sørensen", Content = "Forslag i en nasjonalforsamling om at en minister eller hele regjeringen ikke lenger har nasjonalforsamlingens tillit. Hvis forslaget får flertall i nasjonalforsamlingen, må ministeren eller den sittende regjeringen gå av.", Created = "2018-06-22T15:04:14Z", ExternalId = 167284, StatusId = 1, Title = "Mistillitsforslag", Updated = "2018-08-20T10:15:09Z" },
                        new { Id = 264, Author = "Emily Sørensen", Content = "Forslag i ei nasjonalforsamling om at ein minister eller heile regjeringa ikkje lenger har tillit i nasjonalforsamlinga. Dersom forslaget får fleirtal i nasjonalforsamlinga, må ministeren eller den sitjande regjeringa gå av.", Created = "2018-06-22T15:04:14Z", ExternalId = 167284, StatusId = 1, Title = "Mistillitsforslag", Updated = "2018-08-20T10:15:09Z" },
                        new { Id = 394, Author = "Emily Sørensen", Content = "En mening eller oppfatning som vi har gjort oss opp på tross av manglende eller begrenset kunnskap om temaet vi mener noe om.", Created = "2018-06-22T14:57:46Z", ExternalId = 167254, StatusId = 1, Title = "Fordom", Updated = "2018-08-17T16:09:52Z" },
                        new { Id = 395, Author = "Emily Sørensen", Content = "Ei meining eller oppfatning som vi har gjort oss opp trass i manglande eller avgrensa kunnskap om temaet vi meiner noko om.", Created = "2018-06-22T14:57:46Z", ExternalId = 167254, StatusId = 1, Title = "Fordom", Updated = "2018-08-17T16:09:52Z" },
                        new { Id = 125, Author = "Isak Nordeng Jensen", Content = "Å generalisere, det vil si å lage allmenne regler basert på sammenlikning av enkelttilfeller. I samfunnsfag er det viktig å studere mange enkelttilfeller for å kunne generalisere.", Created = "2018-06-22T14:57:00Z", ExternalId = 167214, StatusId = 1, Title = "Generalisering", Updated = "2018-08-17T17:44:21Z" },
                        new { Id = 126, Author = "Isak Nordeng Jensen", Content = "Det å generalisere, det vil seie å lage allmenne reglar basert på samanlikning av enkelttilfelle. I samfunnsfag er det viktig å studere mange enkelttilfelle for å kunne generalisere.", Created = "2018-06-22T14:57:00Z", ExternalId = 167214, StatusId = 1, Title = "Generalisering", Updated = "2018-08-17T17:44:21Z" },
                        new { Id = 102, Author = "Emily Sørensen", Content = "Utvikling av samfunnet som ikke går på bekostning av framtidige generasjoners tilgang på ressursene.", Created = "2018-06-22T15:06:25Z", ExternalId = 167194, StatusId = 1, Title = "Bærekraftig utvikling", Updated = "2018-08-17T19:12:48Z" },
