                        new { Id = 408, Author = "Emily Sørensen", Content = "Opplysninger om respondentene, som brukes i tillegg til informasjonen fra hovedspørsmålene når man utfører undersøkelser. Kjønn, alder, bosted og yrke er eksempler på bakgrunnsvariabler.", Created = "2018-06-22T14:57:01Z", ExternalId = 167152, StatusId = 1, Title = "Bakgrunnsvariabel", Updated = "2018-08-17T17:44:22Z" },
                        new { Id = 409, Author = "Emily Sørensen", Content = "Opplysningar om respondentane, som blir brukte i tillegg til informasjonen frå hovudspørsmåla når ein utfører undersøkingar. Kjønn, alder, bustad og yrke er døme på bakgrunnsvariablar.", Created = "2018-06-22T14:57:01Z", ExternalId = 167152, StatusId = 1, Title = "Bakgrunnsvariabel", Updated = "2018-08-17T17:44:22Z" },
                        new { Id = 412, Author = "Sissel Paaske", Content = "Redundancy: overflødighet. Å inkludere en ekstra komponent som kan erstatte tapet av en annen uten at drift eller sikkerhet påvirkes. Offshore installeres en ekstra pumpe, et ekstra sikringspanel, et ekstra styringspanel eller annet. Disse har som oppgave å være tilgjengelige (og klar for bruk) om den komponenten som vanligvis er i bruk, feiler.", Created = "2018-06-22T15:45:28Z", ExternalId = 166509, StatusId = 1, Title = "Redundancy – overflødighet", Updated = "2018-09-04T08:43:53Z" },
                        new { Id = 413, Author = "Sissel Paaske", Content = "Redundancy: overflødighet. Å inkludere en ekstra komponent som kan erstatte tapet av en annen uten at drift eller sikkerhet påvirkes. Offshore installeres en ekstra pumpe, et ekstra sikringspanel, et ekstra styringspanel og så videre. Disse har som oppgave enn å være tilgjengelig (og klar for bruk) om den komponenten som vanligvis er i bruk, feiler.", Created = "2018-06-22T15:45:28Z", ExternalId = 166509, StatusId = 1, Title = "Redundancy - overflødighet", Updated = "2018-09-04T08:43:53Z" },
                        new { Id = 351, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Operatør er et fellesord som beskriver selskapet som er tildelt ansvaret for feltet eller blokken. I Norge er det alltid et oljeselskap (Statoil, ConocoPhillips, Talisman osv.) som er operatørselskapet.", Created = "2018-06-22T15:45:33Z", ExternalId = 166414, StatusId = 1, Title = "Operatør", Updated = "2018-09-04T08:43:53Z" },
                        new { Id = 352, Author = "Yttervik Reinholdtsen Lisbeth", Created = "2018-06-22T15:45:33Z", ExternalId = 166414, StatusId = 1, Title = "Operatør", Updated = "2018-09-04T08:43:53Z" },
                        new { Id = 176, Author = "Yttervik Reinholdtsen Lisbeth", Content = "ICD (Inflow Control Device). En strupe-mekanisme som brukes for å redusere (regulere) innstrømningen i brønnen på et avgrenset område. Brukes ofte for å forsinke vanngjennombrudd i hælen på lange horisontale brønner. ICD kommer i ulike utgaver fra flere leverandører.", Created = "2018-06-22T15:40:49Z", ExternalId = 164692, StatusId = 1, Title = "ICD (Inflow control device)", Updated = "2018-09-04T08:43:36Z" },
                        new { Id = 177, Author = "Yttervik Reinholdtsen Lisbeth", Content = "ICD (Inflow Control Device). En strupe-mekanisme som brukes for å redusere (regulere) innstrømningen i brønnen på et avgrenset område. Brukes ofte for å forsinke vanngjennombrudd i hælen på lange horisontale brønner. ICD kommer i ulike utgaver fra flere leverandører.", Created = "2018-06-22T15:40:49Z", ExternalId = 164692, StatusId = 1, Title = "ICD (Inflow control device)", Updated = "2018-09-04T08:43:36Z" },
                        new { Id = 184, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Svellpakning (swell packer) er et rør med utvendig gummi-element som reagerer med væske (olje eller vann) og sveller i størrelse til det tetter mot den utvendige grensen (brønnen).", Created = "2018-06-22T15:40:49Z", ExternalId = 164688, StatusId = 1, Title = "Svellpakning", Updated = "2018-09-04T08:43:41Z" },
                        new { Id = 185, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Svellpakning (swell packer) er et rør med utvendig gummi-element som reagerer med væske (olje eller vann) og sveller i størrelse til det tetter mot den utvendige grensen (brønnen).", Created = "2018-06-22T15:40:49Z", ExternalId = 164688, StatusId = 1, Title = "Svellpakning", Updated = "2018-09-04T08:43:41Z" },
                        new { Id = 325, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Sealbore diverter. En sealbore er et rørstykke som har en innvendig finpolert overflate. Den brukes som tetningsflate mot utvendige tetninger på rør som stikkes inn i sealboren. En sealbore diverter er skråkuttet i toppen og fungerer som en guide som skråner mot et annet løp i brønnen.", Created = "2018-06-22T15:40:50Z", ExternalId = 164686, StatusId = 1, Title = "Sealbore diverter", Updated = "2018-09-04T08:43:44Z" },
                        new { Id = 326, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Sealbore diverter. En sealbore er et rørstykke som har en innvendig finpolert overflate. Den brukes som tetningsflate mot utvendige tetninger på rør som stikkes inn i sealboren. En sealbore diverter er skråkuttet i toppen og fungerer som en guide som skråner mot et annet løp i brønnen.", Created = "2018-06-22T15:40:50Z", ExternalId = 164686, StatusId = 1, Title = "Sealbore diverter", Updated = "2018-09-04T08:43:44Z" },
                        new { Id = 521, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Brønnslisse: En plattform eller havbunnsramme har et begrenset antall åpninger som det kan kobles brønner opp mot. Disse åpningene er på brønnhodedekket og kalles \"slots\". På norsk brukes uttrykket slisser.", Created = "2018-06-22T15:40:44Z", ExternalId = 164645, StatusId = 1, Title = "Brønnslisse", Updated = "2018-09-04T08:43:37Z" },
                        new { Id = 522, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Brønnslisse: En plattform eller havbunnsramme har et begrenset antall åpninger som det kan kobles brønner opp mot. Disse åpningene er på brønnhodedekket og kalles \"slots\". På norsk brukes uttrykket slisser.", Created = "2018-06-22T15:40:44Z", ExternalId = 164645, StatusId = 1, Title = "Brønnslisse", Updated = "2018-09-04T08:43:37Z" },
                        new { Id = 133, Author = "Inga Berntsen Rudi", Content = "Den fruktbare halvmåne viser til et halvmåneformet område i Midtøsten der tidlig jordbruk og sivilisasjoner utviklet seg, og viktige oppfinnelser som skrift og hjulet kom. Begrepet ble skapt som The Fertile Crescent av den amerikanske arkeologen James Henry Breasted tidlige på 1900-tallet. Området følger elvene Jordan, Eufrat og Tigris fra Levanten ved Middelhavet i vest til Mesopotamia og Persiabukta i øst. Det er avgrenset av det anatoliske høylandet i nord og den syriske ørkenen i sør. I dag ligger statene Irak, Syria, Jordan, Libanon, Israel, De palestinske selvstyreområene og deler av Tyrkia og Iran i området. Man kan også regne Nildalen og Egypt med til området, ettersom også dette var frukbart og folkerikt i oldtida, men jordbruk ble ikke utviklet her. (Kilde: Wikipedia)", Created = "2018-05-09T14:47:38Z", ExternalId = 159382, StatusId = 1, Title = "Den fruktbare halvmåne", Updated = "2018-09-04T06:27:30Z" },
                        new { Id = 134, Author = "Inga Berntsen Rudi", Content = "Den fruktbare halvmånen viser til eit halvbogeforma område i Midtausten der tidleg jordbruk og sivilisasjon utvikla seg, og viktige nyvinngar som skrift og hjulet kom til. Omgrepet blei skapt som The Fertile Crescent av den amerikanske arkeologen James Henry Breasted tidleg på 1900-talet. Området følgjer elvane Jordan, Eufrat og Tigris frå Levanten ved Middelhavet i vest til Mesopotamia og Persiabukta i aust. Det er avgrensa av det anatoliske høglandet i nord og Den syriske ørkenen i sør. I dag ligg statane Irak, Syria, Jordan, Libanon, Israel, Dei palestinske sjølvstyresmaktene og delar av Tyrkia og Iran i området. Ein kan også rekna Nildalen og Egypt med til området, ettersom også dette var fruktsamt og folkesett i oldtida, men jordbruk blei ikkje utvikla her. (Kjelde: Wikipedia)", Created = "2018-05-09T14:47:38Z", ExternalId = 159382, StatusId = 1, Title = "Den fruktbare halvmåne", Updated = "2018-09-04T06:27:30Z" },
                        new { Id = 505, Author = "Sissel Paaske", Content = "Fra engelsk location. Lokasjon er det stedet der installasjonen skal ligge over en brønn eller starte brønnboring. Lokasjonen har nøyaktige satellittkoordinater som brukes for å plassere en fast installasjon korrekt på feltet, for å plassere en flytende enhet før ankring, eller som referansepunkter når enheten skal holdes på plass med DP.", Created = "2018-06-22T15:29:48Z", ExternalId = 155896, StatusId = 1, Title = "Lokasjon", Updated = "2018-08-17T14:22:13Z" },
                        new { Id = 506, Author = "Sissel Paaske", Content = "Fra engelsk location. Lokasjon er stedet der installasjonen skal ligge over en brønn, eller starte brønnboring. Lokasjon har nøyaktige satellittkoordinater som brukes for å plassere en fast installasjon korrekt på feltet, for å plassere en flytende enhet før ankring, eller som referansepunkter når den skal holdes på plass med DP.", Created = "2018-06-22T15:29:48Z", ExternalId = 155896, StatusId = 1, Title = "Lokasjon", Updated = "2018-08-17T14:22:13Z" },
                        new { Id = 422, Author = "Sissel Paaske", Content = "Kompensere betyr å oppveie, utjevne, erstatte. Når man kompenserer for noe, retter man opp en forandring eller unøyaktighet, eller skaper en balanse. Borestrengskompensering er å lage en bevegelse som virker motsatt av de vertikale bølgebevegelsene, slik at borestrengen blir stående i ro i forhold til borehullet (brønnen).", Created = "2018-06-22T15:32:09Z", ExternalId = 155856, StatusId = 1, Title = "Kompensering", Updated = "2018-08-17T14:22:08Z" },
                        new { Id = 423, Author = "Sissel Paaske", Content = "Kompensere betyr å oppveie, utjevne, erstatte. Når man kompenserer for noe retter man opp en forandring eller unøyaktighet, eller skaper en balanse. Borestrengskompensering er å lage en bevegelse som virker motsatt av de vertikale bølgebevegelsene, slik at borestrengen blir stående i ro i forhold til borehullet (brønnen).", Created = "2018-06-22T15:32:09Z", ExternalId = 155856, StatusId = 1, Title = "Kompensering", Updated = "2018-08-17T14:22:08Z" },
                        new { Id = 418, Author = "Sissel Paaske", Content = "Thrustere er spesielle propeller som er innfelt i skroget på den flytende enheten, ofte i siden foran og bak på fartøyet. Kalles ofte sidepropell. Brukes både til posisjonering og framdrift.", Created = "2018-06-22T15:32:04Z", ExternalId = 155892, StatusId = 1, Title = "Thruster", Updated = "2018-08-17T14:22:14Z" },
                        new { Id = 419, Author = "Sissel Paaske", Content = "Thrustere er en spesiell propell som er innfelt i skroget på den flytende enheten, ofte i siden foran og bak i fartøyet. Kalles ofte sidepropell. Brukes både til posisjonering og framdrift.", Created = "2018-06-22T15:32:04Z", ExternalId = 155892, StatusId = 1, Title = "Thruster", Updated = "2018-08-17T14:22:14Z" },
                        new { Id = 120, Author = "Inga Berntsen Rudi", Content = "Etruskarane er eit folk vi veit relativt lite om. På øya Lemnos i Egeerhavet er det funne ei innskrift frå 600-talet f.Kr., på eit språk som liknar etruskisk. Nokre forskarar tolkar det som at dei hadde innvandra frå aust. Andre meiner Etruskarane var eit urfolk i Toscana. Elles har det berre blitt funne få og korte tekstar på etruskisk, der vi veit tydinga av om lag 100 ord. Det er noko av grunnen til at vi veit så lite om dei. Etruskarane hadde ein blomstringstid då Roma vart grunnlagt, men vart gradvis svekka etter kvart som den nye naboen vaks. Omtrent ved overgangen til romersk keisartid, var heile den etruskiske befolkninga latinisert.", Created = "2018-05-09T14:49:13Z", ExternalId = 156327, StatusId = 1, Title = "Etruskarane", Updated = "2018-09-04T06:47:26Z" },
                        new { Id = 98, Author = "Inga Berntsen Rudi", Content = "Prognoser eller utviklingsforløp i framtiden. Hvordan eksperter mener utviklingen vil gå, f.eks innen innvandring, befolkningsvekst, økonomi o.l.", Created = "2018-06-22T15:07:07Z", ExternalId = 83591, StatusId = 1, Title = "Framskrivinger", Updated = "2018-08-17T17:14:56Z" },
                        new { Id = 99, Author = "Inga Berntsen Rudi", Content = "Prognosar eller utviklingsgang i framtida. Korleis ekspertar meiner utviklinga vil gå, til dømes innan innvandring, befolkningsvekst og økonomi.", Created = "2018-06-22T15:07:07Z", ExternalId = 83591, StatusId = 1, Title = "Framskrivingar", Updated = "2018-08-17T17:14:56Z" },
                        new { Id = 291, Author = "Sissel Paaske", Content = "Flokkulering beskriver dannelse av en større masse (flokk). Brukes for å beskrive hvordan avlange leirepartikler (f.eks. i bentonittslam) binder seg til hverandre med kortside mot langside, eller langside mot langside. Konsekvensen av slik samling er økt viskositet og økt filtertap.", Created = "2018-06-22T15:36:02Z", ExternalId = 153372, StatusId = 1, Title = "Flokkulering", Updated = "2018-09-04T08:43:57Z" },
                        new { Id = 292, Author = "Sissel Paaske", Content = "Flokkulering beskriver dannelse av en større masse (flokk). Brukes for å beskrive hvordan avlange leirepartikler (f.eks. i bentonittslam) binder seg til hverandre med kortside mot langside, eller langside mot langside. Konsekvensen av slik samling er økt viskositet og økt filtertap.", Created = "2018-06-22T15:36:02Z", ExternalId = 153372, StatusId = 1, Title = "Flokkulering", Updated = "2018-09-04T08:43:57Z" },
                        new { Id = 388, Author = "Sissel Paaske", Content = "Filterkake dannes på overflaten av et filter når partikler fra en væske stoppes, mens væsken passerer gjennom filteret. Når filterkaken er tett, vil den hindre væske fra å strømme gjennom filteret. Filterkake i brønnen hindrer tap av borevæske inn i formasjonen.", Created = "2018-06-22T15:35:53Z", ExternalId = 151694, StatusId = 1, Title = "Filterkake", Updated = "2018-09-04T08:43:34Z" },
                        new { Id = 389, Author = "Sissel Paaske", Content = "Filterkake dannes på overflaten av et filter når partikler fra en væske stoppes, mens væsken passerer gjennom filteret. Når filterkaken er tett, vil den hindre væske fra å strømme gjennom filteret. Filterkake i brønnen hindrer tap av borevæske inn i formasjonen.", Created = "2018-06-22T15:35:53Z", ExternalId = 151694, StatusId = 1, Title = "Filterkake", Updated = "2018-09-04T08:43:34Z" },
                        new { Id = 190, Author = "Sissel Paaske", Content = "Filtrat er filtrert væske, der partikler og forurensninger blir holdt tilbake på et filter, mens væsken (filtratet) går gjennom filteret. Filtrat i forbindelse med borevæske er væsken som klarer å trenge inn i formasjonens porer, mens partiklene stopper på overflaten av formasjonen og danner filterkake.", Created = "2018-06-22T15:35:52Z", ExternalId = 151693, StatusId = 1, Title = "Filtrat", Updated = "2018-09-04T08:43:37Z" },
                        new { Id = 191, Author = "Sissel Paaske", Content = "Filtrat er filtrert væske, der partikler og forurensninger blir holdt tilbake på et filter, mens væsken (filtratet) går gjennom filteret. Filtrat i forbindelse med borevæske er væsken som klarer å trenge inn i formasjonens porer, partiklene stopper på overflaten av formasjonen og danner filterkake.", Created = "2018-06-22T15:35:52Z", ExternalId = 151693, StatusId = 1, Title = "Filtrat", Updated = "2018-09-04T08:43:37Z" },
                        new { Id = 317, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Entringsvakt: Passer på personen(e) som har entret et risiko-område eller tank. Skal ha kontinuerlig kontakt med de som overvåkes.", Created = "2018-06-22T15:46:15Z", ExternalId = 148658, StatusId = 1, Title = "Entringsvakt", Updated = "2018-09-04T08:43:53Z" },
                        new { Id = 318, Author = "Yttervik Reinholdtsen Lisbeth", Content = "Entringsvakt: Passer på personen(e) som har entret et risiko-område eller tank. Skal ha kontinuerlig kontakt med de som overvåkes.", Created = "2018-06-22T15:46:15Z", ExternalId = 148658, StatusId = 1, Title = "Entringsvakt", Updated = "2018-09-04T08:43:53Z" },
