                        new { Id = 439, Author = "Sissel Paaske", Content = "Brønnhodetrykk er trykket som den produserte væsken/gassen har når den er kommet opp til brønnhodet i toppen av brønnen. På engelsk: wellhead pressure. Det opprinnelige trykket i reservoaret reduseres opp til brønnhodet på grunn av friksjon og hydrostatisk mottrykk i produksjonsrøret.", Created = "2018-06-22T15:38:59Z", ExternalId = 150242, StatusId = 1, Title = "Brønnhodetrykk", Updated = "2018-09-04T08:43:58Z" },
