                        new { Id = 261, Author = "Sissel Paaske", Content = "Konus er en geometrisk form bestående av en sylinder med en bred og en smal ende. Eksempel på kon-form kan være melkeglass, vaskebøtte, lampeskjerm osv. Konisiteten er et forholdstall mellom den brede enden og den smale enden.", Created = "2018-06-22T15:34:17Z", ExternalId = 149589, StatusId = 1, Title = "Konus", Updated = "2018-09-04T08:43:36Z" },
