                        new { Id = 65, Author = "Ragna Tørdal", Content = "Cliffhanger: fortellermessig grep i film, stammer fra stumfilmtidens seriefilmer. Disse ble vist på kino avsnitt for avsnitt, og for å lokke publikum til neste avsnitt kunne man avslutte med en scene hvor hovedpersonen var i en farlig situasjon uten utveier, f.eks. presset av overtallige skurker, kastet i bjørnegården, plassert bundet på en jernbanelinje – eller etterlatt hengende fra en fjellhylle, derav navnet. Neste avsnitt måtte da innledes med heltens mirakuløse redning. Slike spenningsskapende grep har også vært benyttet i fjernsynsserier, og begrepet er dessuten blitt tatt i bruk i litteraturen. I Store norske leksikon. Hentet fra: http://snl.no/cliffhanger", Created = "2018-05-04T21:19:38Z", ExternalId = 100722, StatusId = 1, Title = "Cliffhanger", Updated = "2018-05-27T21:10:40Z" },
