                        new { Id = 118, Author = "", Content = "Trontaledebatten er ein debatt om den årlege trontalen. Trontalen blir lesen opp av Kongen ved den høgtidelege opninga av Stortinget og inneheld regjeringas programerklæring for året som kjem.", Created = "2018-06-22T15:02:29Z", ExternalId = 11288, StatusId = 1, Title = "Trontaledebatten", Updated = "2018-08-20T10:16:46Z" },
                        new { Id = 119, Author = "", Content = "Trontaledebatten er en debatt om den årlige trontalen. Trontalen leses opp av Kongen ved Stortingets høytidelige åpning og inneholder regjeringens programerklæring for kommende år.", Created = "2018-06-22T15:02:29Z", ExternalId = 11288, StatusId = 1, Title = "Trontaledebatten", Updated = "2018-08-20T10:16:46Z" },
                        new { Id = 19, Author = "Sigurd Alnæs", Content = "Ein strategi for problemløysing som startar med primitivane. Strategien kan vere målretta, slik at primitivar blir sette saman til ein heilskap med eit bestemt mål i sikte. Strategien kan også brukast på ein meir tilfeldig måte, utan eit klart mål i sikte. Målet kan formast etter kvart som du løyser fleire av primitivane.", Created = "2018-05-04T14:59:12Z", ExternalId = 48020, StatusId = 1, Title = "Bygg opp-strategi", Updated = "2018-05-04T15:00:04Z" },
                        new { Id = 20, Author = "Sigurd Alnæs", Content = "En strategi for problemløsing som starter med primitivene. Strategien kan være målrettet, slik at primitiver settes sammen til en helhet med et bestemt mål i sikte. Strategien kan også brukes på en mer tilfeldig måte, uten et klart mål i sikte. Målet kan formes etter hvert som du løser flere av primitivene.", Created = "2018-05-04T14:59:12Z", ExternalId = 48020, StatusId = 1, Title = "Bygg opp-strategi", Updated = "2018-05-04T15:00:04Z" },
                        new { Id = 13, Author = "Sigurd Alnæs", Content = "Eit programmeringsspråk som til dømes BASIC, COBOL, Logo, Java, C++, C# eller PHP. Alle kodelinjer i språket blir omsette av datamaskina til maskinspråk. Høgnivåspråk er lettare å forstå enn maskinspråk, fordi det liknar meir på vårt eige talespråk enn maskinspråk gjer.", Created = "2018-05-04T14:09:59Z", ExternalId = 48072, StatusId = 1, Title = "Høgnivåspråk", Updated = "2018-05-04T15:00:02Z" },
                        new { Id = 14, Author = "Sigurd Alnæs", Content = "Et programmeringsspråk som for eksempel BASIC, COBOL, Logo, Java, C++, C# eller PHP. Alle kodelinjer i språket oversettes av datamaskinen til maskinspråk. Høynivåspråk er lettere å forstå enn maskinspråk, fordi det ligner mer på vårt eget talespråk enn maskinspråk gjør.", Created = "2018-05-04T14:09:59Z", ExternalId = 48072, StatusId = 1, Title = "Høynivåspråk", Updated = "2018-05-04T15:00:02Z" },
                        new { Id = 17, Author = "Sigurd Alnæs", Content = "Å fjerne feil frå dataprogram ved å analysere den overordna prosessen for å løyse eit problem.", Created = "2018-05-04T14:09:59Z", ExternalId = 48037, StatusId = 1, Title = "Debug", Updated = "2018-05-04T15:00:03Z" },
                        new { Id = 18, Author = "Sigurd Alnæs", Content = "Å fjerne feil fra dataprogrammer ved å analysere den overordnede prosessen for å løse et problem.", Created = "2018-05-04T14:09:59Z", ExternalId = 48037, StatusId = 1, Title = "Debug", Updated = "2018-05-04T15:00:03Z" },
                        new { Id = 3, Author = "Sigurd Alnæs", Content = "Ein feil eller ei misforståing. Ein bug i eit dataprogram kan komme av ein feil i planen for å lage programmet. Det kan òg vere ein feil eller ei misforståing i prosedyren som blir programmert.", Created = "2018-05-04T14:10:00Z", ExternalId = 48019, StatusId = 1, Title = "Bug", Updated = "2018-05-04T15:00:03Z" },
                        new { Id = 4, Author = "Sigurd Alnæs", Content = "En feil eller en misforståelse. En bug i et dataprogram kan skyldes en feil i planen for å lage programmet. Det kan også være en feil eller misforståelse i prosedyren som programmeres.", Created = "2018-05-04T14:10:00Z", ExternalId = 48019, StatusId = 1, Title = "Bug", Updated = "2018-05-04T15:00:03Z" },
                        new { Id = 1, Author = "Sigurd Alnæs", Content = "Kvar datamaskin er laga for å ”forstå”. Det betyr at datamaskina må vere i stand til å utføre ei avgrensa mengd handlingar og operasjonar. Slike operasjonar, eller primitivar, kallar vi maskinspråk. Ulike merke og modellar har forskjellig maskinspråk.", Created = "2018-05-04T14:10:00Z", ExternalId = 48094, StatusId = 1, Title = "Maskinspråk", Updated = "2018-05-04T15:00:04Z" },
                        new { Id = 2, Author = "Sigurd Alnæs", Content = "Hver datamaskin er laget for å ”forstå”. Det betyr at datamaskinen må være i stand til å utføre et begrenset antall handlinger og operasjoner. Slike operasjoner, eller primitiver, kalles maskinspråk. Ulike merker og modeller har forskjellig maskinspråk.", Created = "2018-05-04T14:10:00Z", ExternalId = 48094, StatusId = 1, Title = "Maskinspråk", Updated = "2018-05-04T15:00:04Z" },
                        new { Id = 80, Author = "Inga Berntsen Rudi", Content = "FN-pakta er den avtalen som etablerte organisasjonen Dei sameinte nasjonane (FN).", Created = "2018-05-09T15:44:53Z", ExternalId = 60708, StatusId = 1, Title = "FN-pakta", Updated = "2018-09-04T06:47:08Z" },
