                        new { Id = 66, Author = "", Content = "Genutgave, alternativ utgave av et gen. Alle individer har to allel for hvert gen. Det ene allelet er nedarvet fra far og det andre fra mor. Eksempel: Det finnes allel for blå og brun øyenfarge. Det brune dominerer over det blå, så dersom du har blå øyne kan du være sikker på at du har to allel med kode for blå øyne.", Created = "2018-05-27T23:41:29Z", ExternalId = 9104, StatusId = 1, Title = "Allel", Updated = "2018-06-11T09:17:58Z" },
                        new { Id = 67, Author = "", Content = "Genutgåve, alternativ utgåve av eit gen. Alle individ har to allel for kvart gen. Det eine allelet er nedarva frå far og det andre frå mor. Eksempel: Det finnast allel for blå og brun augefarge. Det brune dominerer over det blå, så dersom du har blå auge kan du være viss på at du har to allel med kode for blå auge.", Created = "2018-05-27T23:41:29Z", ExternalId = 9104, StatusId = 1, Title = "Allel", Updated = "2018-06-11T09:17:58Z" },
