                        new { Id = 121, Author = "", Content = "Hercules `søyler er et område i dag kjent som Gibraltar i nord og fjellene i Marokko. Navnet Gibraltar er utledet fra det arabiske Tariqs fjell, etter hærføreren Tariq ibn Ziyad som ledet en berberdominert hær over stredet fra Ceuta i 711.", Created = "2018-05-09T14:55:38Z", ExternalId = 182746, StatusId = 1, Title = "Hercules `søyler", Updated = "2018-09-04T06:45:38Z" },
                        new { Id = 122, Author = "", Content = "Heculus' søyler er eit område i dag kjent som Gibraltar i nord og fjella i Marokko. Namnet Gibraltar er utleidd frå det arabiske Tariqs fjell, etter hærføraren Tariq ibn Ziyad som leidde ein berbardominert hær over stretet frå Ceuta i 711.", Created = "2018-05-09T14:55:38Z", ExternalId = 182746, StatusId = 1, Title = "Herculus' søyler", Updated = "2018-09-04T06:45:38Z" },
                        new { Id = 127, Author = "", Content = "Mistillitsforslag kan fremmes for Stortinget av en eller flere stortingsrepresentanter. Dersom det blir vedtatt, innebærer det et mistillitsvotum. Det er en uttalelse som uttrykker at stortingsflertallet ikke har tillit til regjeringen eller til en enkelt statsråd. Regjeringen eller statsråden tvinges dermed til å gå av.", Created = "2018-05-09T15:17:35Z", ExternalId = 11254, StatusId = 1, Title = "mistillitsforslag", Updated = "2018-09-04T08:51:49Z" },
                        new { Id = 128, Author = "", Content = "Mistillitsforslag kan fremjast for Stortinget av ein eller fleire stortingsrepresentantar. Dersom det blir vedteke, inneber det eit mistillitsvotum. Det er ei ytring som uttrykkjer at stortingsfleirtalet ikkje har tillit til regjeringa eller til ein einskild statsråd. Regjeringa eller statsråden blir med det tvinga til å gå av.", Created = "2018-05-09T15:17:35Z", ExternalId = 11254, StatusId = 1, Title = "mistillitsforslag", Updated = "2018-09-04T08:51:49Z" },
                        new { Id = 129, Author = "", Content = "Bruttonasjonalproduktet (BNP) viser verdien av alt som skapes/produseres i et land. BNP omfatter verdiskapingen i all markedsrettet næringsvirksomhet, dessuten offentlig forvaltning, ideelle organisasjoner og produksjon for eget bruk. BNP per innbygger brukes ofte som et mål på velstandsnivået i et land. SSB", Created = "2018-05-09T15:56:08Z", ExternalId = 1798, StatusId = 1, Title = "Bruttonasjonalprodukt (BNP)", Updated = "2018-09-04T08:31:26Z" },
                        new { Id = 130, Author = "", Content = "Bruttonasjonalproduktet (BNP) syner verdien av alt som blir skapt/produsert i eit land. BNP omfattar verdiskapinga i all marknadsretta næringsverksemd, dessutan offentleg forvalting, ideelle organisasjonar og produksjon for eigen bruk. BNP per innbyggjar blir ofte nytta som eit mål på velstandsnivået i eit land. SSB", Created = "2018-05-09T15:56:08Z", ExternalId = 1798, StatusId = 1, Title = "Bruttonasjonalprodukt (BNP)", Updated = "2018-09-04T08:31:26Z" },
