                        new { Id = 137, Author = "", Content = "Naturgasskondensat er i gassform i reservoaret, men kondenserer til væske når temperaturen blir redusert til under duggpunktet til rågass. Temperaturfallet inntreffer vanligvis i produksjonsrøret på vei fra reservoar til overflaten, eller i overflateutstyret.", Created = "2018-06-22T15:42:09Z", ExternalId = 151148, StatusId = 1, Title = "Kondensat", Updated = "2018-09-04T08:43:46Z" },
