                        new { Id = 148, Author = "", Content = "DP: Dynamic Positioning, datastyrt navigasjonssystem som bruker satellittkommunikasjon for å holde fartøyet i samme posisjon uansett bølger, vind og strøm i havet. Navigasjonssystemet kommuniserer med systemet for sidepropeller (truster) for å holde fartøyet i posisjon.", Created = "2018-06-22T15:29:52Z", ExternalId = 141020, StatusId = 1, Title = "DP - Dynamisk Posisjonering", Updated = "2018-08-17T14:22:15Z" },
                        new { Id = 149, Author = "", Content = "DP; Dynamic Positioning, datastyrt navigeringssystem som bruker satelittkommunikasjon for å holde fartøyet i samme posisjon uansett bølger, vind og strøm i havet. Navigasjonssystemet kommuniserer med systemet for sidepropeller (truster) for å holde fartøyet i posisjon.", Created = "2018-06-22T15:29:52Z", ExternalId = 141020, StatusId = 1, Title = "DP - Dynamisk Posisjonering", Updated = "2018-08-17T14:22:15Z" },
                        new { Id = 152, Author = "", Content = "Asfaltener (uttale: asfaltˈener), kompliserte hydrokarboner som også kan inneholde mindre mengder nitrogen, oksygen og svovel. Utgjør hovedkomponentene i asfalt og er en av komponentene i tunge fyringsoljer. Visse råoljer (særlig i Venezuela) inneholder asfaltener, for øvrig dannes de ved raffinering av olje. De er løselige i benzen og karbondisulfid, uløselige i n-heptan.", Created = "2018-06-22T15:39:31Z", ExternalId = 146360, StatusId = 1, Title = "Asfaltener", Updated = "2018-09-04T08:44:35Z" },
                        new { Id = 153, Author = "", Content = "Asfaltener (uttale: asfaltˈener), kompliserte hydrokarboner som også kan inneholde mindre mengder nitrogen, oksygen og svovel. Utgjør hovedkomponentene i asfalt og er en av komponentene i tunge fyringsoljer. Visse råoljer (særlig i Venezuela) inneholder asfaltener, for øvrig dannes de ved raffinering av olje. De er løselige i benzen og karbondisulfid, uløselige i n-heptan.", Created = "2018-06-22T15:39:31Z", ExternalId = 146360, StatusId = 1, Title = "Asfaltener", Updated = "2018-09-04T08:44:35Z" },
                        new { Id = 154, Author = "", Content = "Kaliper; et måleinstrument som kan gi avtrykk av utvendig eller innvendig diameter. To (eller flere for innvendig type) \"armer\" i stål er festet i et sentralt punkt. Armene er enten kurvet utover (for innvendig måling) eller innover (for utvendig måling). Når kaliper føres over diameteren justeres armene inn til veggen. Kaliperen leses av med skyvelære eller digitalt for å finne nøyaktig diameter.", Created = "2018-06-22T15:43:21Z", ExternalId = 148218, StatusId = 1, Title = "Kaliper", Updated = "2018-09-04T08:44:45Z" },
                        new { Id = 155, Author = "", Content = "Kaliper; et måleinstrument som kan gi avtrykk av utvendig eller innvendig diameter. To (eller flere for innvendig type) \"armer\" i stål er festet i et sentralt punkt. Armene er enten kurvet utover (for innvendig måling) eller innover (for utvendig måling). Når kaliper føres over diameteren justeres armene inn til veggen. Kaliperen leses av med skyvelære eller digitalt for å finne nøyaktig diameter.", Created = "2018-06-22T15:43:21Z", ExternalId = 148218, StatusId = 1, Title = "Kaliper", Updated = "2018-09-04T08:44:45Z" },
