                        new { Id = 238, Author = "", Content = "En kravspesifikasjon er de kravene som stilles til et produkt. Når man ber om et anbud, er det vanlig å stille visse krav til produktet. Er det for eksempel mat til en polekspedisjon, stilles det krav om holdbarhet og næringsinnhold.", Created = "2018-05-27T22:24:27Z", ExternalId = 186758, StatusId = 1, Title = "Kravspesifikasjon", Updated = "2018-09-04T08:44:47Z" },
                        new { Id = 239, Author = "", Content = "Ein kravspesifikasjon er dei krava som blir stilte til eit produkt. Når ein ber om eit anbod, er det vanleg å stille visse krav til produktet. Gjeld det til dømes mat til ein polekspedisjon, stiller ein krav om haldbarheit og næringsinnhald.", Created = "2018-05-27T22:24:27Z", ExternalId = 186758, StatusId = 1, Title = "Kravspesifikasjon", Updated = "2018-09-04T08:44:47Z" },
                        new { Id = 240, Author = "", Content = "Pigg (engelsk: pig) er en plugg som skyves gjennom rør ved hjelp av væske som pumpes bak piggen. Differensialtrykket forskyver piggen og væsken/gassen foran denne. Piggen sendes inn i og tas ut av rørledningen i spesielle stasjoner som er koblet til rørledningen. Piggens oppgave kan være å rense røret, skrape innsiden, kalibrere (måle) innvendig diameter, osv.", Created = "2018-06-22T15:43:24Z", ExternalId = 146117, StatusId = 1, Title = "Pigg", Updated = "2018-09-04T08:44:39Z" },
                        new { Id = 241, Author = "", Content = "Pigg (engelsk: pig) er en plugg som skyves gjennom rør ved hjelp av væske som pumpes bak piggen. Differensialtrykket forskyver piggen og væsken/gassen foran denne. Piggen sendes inn i og tas ut av rørledningen i spesielle stasjoner som er koblet til rørledningen. Piggens oppgave kan være å rense røret, skrape innsiden, kalibrere (måle) innvendig diameter, osv.", Created = "2018-06-22T15:43:24Z", ExternalId = 146117, StatusId = 1, Title = "Pigg", Updated = "2018-09-04T08:44:39Z" },
