                        new { Id = 252, Author = "", Content = "Idémyldring er ein teknikk der fleire personar i eit møte kastar fram flest mogleg idear om eit tema. Alle idear blir helste velkomne utan kritikk. Først seinare går vi kritisk gjennom dei ideane som er komne fram.", Created = "2018-05-04T20:57:48Z", ExternalId = 91118, StatusId = 1, Title = "Idémyldring", Updated = "2018-09-04T06:40:16Z" },
