                        new { Id = 279, Author = "", Content = "IBOP - Internal Blow Out Preventer, er en sikringsventil som er montert i øverste del av borestrengen i Topdrive. Den skal hindre utblåsning gjennom borestrengen på overflaten. Den er automatisk og stenger dersom det oppstår trykk fra undersiden i borestrengen. Den kan også stenges via styringspanelet i Drillers Cabin. Det finnes også en egen type IBOP som kan monteres i borestrengen og føres inn i brønnen.", Created = "2018-06-22T15:30:42Z", ExternalId = 158998, StatusId = 1, Title = "IBOP", Updated = "2018-09-04T08:43:53Z" },
                        new { Id = 280, Author = "", Content = "IBOP - Internal Blow Out Preventer, er en sikringsventil som er montert i øverste del av borestrengen i Topdrive. Den skal hindre utblåsning gjennom borestrengen på overflaten. Den er automatisk og stenger dersom det oppstår trykk fra undersiden i borestrengen. Den kan også stenges via styringspanelet i Drillers Cabin. Det finnes også en egen type IBOP som kan monteres i borestrengen og føres inn i brønnen.", Created = "2018-06-22T15:30:42Z", ExternalId = 158998, StatusId = 1, Title = "IBOP ", Updated = "2018-09-04T08:43:53Z" },
